INSERT INTO `pquest_objectives` VALUES ('7', '4', 'Stage III', '2', 'Dulgrek Ironmane', '1', 'Dulgrek Ironmane and his Dwarfs bravely charge from the newly cracked door.  The Dwarfs must be defeated if the greenskins are to prevail at Ironmane\'s Loch.', '93', null, null, null, null, null, '8002', '0', '1', '0', '1', '1');
