INSERT INTO `pquest_objectives` VALUES ('10', '5', 'Stage II', '3', 'Lobber Rocks collected', '30', 'Gather the ammunition needed for Grokk\'s Rock Lobbers while avoiding the invasion of the Dwarfs who have come to retake the mine.', '402', null, null, null, null, null, '8005', '0', '0', '0', '1', '1');
