INSERT INTO `pquest_objectives` VALUES ('15', '6', 'Stage I', '2', 'Kill Dog Forces', '100', 'The bandits have been attacking the greenskins as they pass.  They must be killed to clear the way to the siege shop.', '254', '2556', null, null, null, null, '8008', '0', '0', '0', '1', '1');
