INSERT INTO `pquest_objectives` VALUES ('18', '6', 'Stage III', '2', 'Evert Webb', '1', 'Evert Webb emerges from his camp to take back control of the road.  Kill him and clear the way so the greenskins can get their newly built siege equipment to the fight!', '2576', null, null, null, null, null, '8010', '0', '0', '0', '1', '1');
