INSERT INTO `pquest_objectives` VALUES ('63', '17', 'Stage I', '2', 'Bloody Sun Greenskins', '30', 'The greenskins defend their rock lobbers viciously.  Clearing the camp of its fighters should make an attack on the lobbers much easier.', '3622', null, null, null, null, null, '8804', '0', '0', '0', '1', '1');
