INSERT INTO `pquest_objectives` VALUES ('67', '17', 'Stage III', '2', 'Drahzag Neckbreaker', '1', 'With a roar, Drahzag Neckbreaker charges the Dwarfs.  His death will ensure an end to the greenskin barrage.', '1000367', null, null, null, null, null, '8806', '0', '0', '0', '1', '1');
