INSERT INTO `pquest_objectives` VALUES ('69', '19', 'Stage I', '2', 'Ironclaw Greenskins', '15', 'Squig Herders drive the Squigs to bite and gnaw at the ore in the mines.  Securing the mines must start with the death of the greenskins and their squigs.', '7530', null, null, null, null, null, '8816', '0', '0', '0', '1', '1');
