INSERT INTO `pquest_objectives` VALUES ('72', '19', 'Stage III', '2', 'Gribal da Squigmaster', '1', 'Gribal the Squigmaster controls the squigs of the mine. Find him and his cohort of deadly squigs. Defeat them all!', '1000843', null, null, null, null, null, '8818', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('73', '20', 'Stage I', '2', 'Kill Ironclaw Boyz', '50', 'Marghaz and his Shamans channel energy from the powerful effigies. Defeat the guards protecting the camp, then kill the Shamans. Once the Shamans are eliminated, the effigies should be extinguished.  ', '3236', null, null, null, null, null, '8808', '0', '0', '0', '1', '1');
