INSERT INTO `pquest_objectives` VALUES ('75', '20', 'Stage II', '2', 'Hammerstrikers Lost', '10', 'The Hammerstrikers arrive to aid in the battle against Marghaz. Protect the Dwarfs as they make their way to the Shaman\'s hut!', '3236', null, null, null, null, null, '8809', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('76', '20', 'Stage III', '2', 'Marghaz Bloodtoof', '1', 'Marghaz Bloodtoof has completed his ritual and wiped out the Hammerstrikers. He and his minions must be defeated!  ', '1000844', null, null, null, null, null, '8810', '0', '1', '0', '1', '1');
