INSERT INTO `pquest_objectives` VALUES ('78', '21', 'Stage I', '2', 'Dog Soldiers', '100', 'The bandit leader Dietrich and his Paymasters are away from camp, preying on passers by in Mount Bloodhorn.  Take advantage of their absence and thin the bandit ranks.', '259', '11304', null, null, null, null, '8812', '0', '0', '0', '1', '1');
