INSERT INTO `pquest_objectives` VALUES ('150', '38', 'Stage II', '2', 'Gruznug', '1', 'The Bloody Sun Boss, Gruznug, has pushed his way to the front of the battle. The situation bodes ill for Gudrim\'s forces if he cannot be defeate d quickly!', '1081163', null, null, null, null, null, '8853', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('151', '39', 'Stage I', '2', 'Kill Black Skull Greenskins', '125', 'The Black Skull greenskins have been taking Oathbearers captive and doing unspeakable things to them! They\'ve even begun shaving off their beards! Kill the Sneakers and Taunters who are tormenting the captured Dwarfs!', '17720', '7429', null, null, null, null, '8856', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('152', '39', 'Stage II', '3', 'Free the captured Dwarfs', '10', 'The Black Skull Shavers have arrived! Slay Black Skull Shavers and free the captured Dwarfs before they suffer the most horrible of indignities!', '99152', '', null, null, null, null, '8857', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('153', '39', 'Stage III', '2', 'Kill the Foulspawn', '1', 'The latent energy of the Marshes of Madness has created a horror within the heart of the Tree of Beards. Slay the Foulspawn and purify this place of its taint!', '1000598', null, null, null, null, null, '8858', '0', '0', '107', '8', '5');
INSERT INTO `pquest_objectives` VALUES ('154', '40', 'Stage I', '2', 'Reanimated Servants', '30', 'The Mourkain artifacts in this cave have attracted the attention of a foul necromancer! Remove his undead servants!', '4231', null, null, null, null, null, '8860', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('155', '40', 'Stage II', '2', 'Nushtar Minions', '10', 'The necromancer has sent his strongest creations to secure the power of the ruins! Defeat them and destroy the artifacts!', '1081912', null, null, null, null, null, '8861', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('156', '40', 'Stage II', '3', 'Destroy Magical Ruins', '10', 'The necromancer has sent his strongest creations to secure the power of the ruins! Defeat them and destroy the artifacts!', '99672', null, null, null, null, null, '8861', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('157', '40', 'Stage III', '2', 'Nushtar', '1', 'The arrogant Necromancer never believed the Oathbearer forces could make it this far! He awaits at the cave\'s mouth, hoping to make this the Dwarfs\' tomb!', '1000621', null, null, null, null, null, '8862', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('158', '40', 'Stage III', '2', 'Angered Wights', '2', 'The arrogant Necromancer never believed the Oathbearer forces could make it this far! He awaits at the cave\'s mouth, hoping to make this the Dwarfs\' tomb!', '1081004', null, null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('159', '41', 'Stage I', '3', 'Plugged Dam Holes', '10', 'The Dam Wreckas are burrowing into the dam. Plug those holes before the whole of Reekmarsh Camp is flooded!', '99710', null, null, null, null, null, '8864', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('160', '41', 'Stage I', '2', 'Dam Wreckas', '100', 'The Dam Wreckas are burrowing into the dam. Plug those holes before the whole of Reekmarsh Camp is flooded!', '4230', null, null, null, null, null, '8864', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('161', '41', 'Stage II', '2', 'Toadlars', '10', 'The holes in the dam seem to be under control, but the Toadlar population most definitely is not. Kill those Toadlars before they overrun the dam!  ', '1000599', null, null, null, null, null, '8865', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('162', '41', 'Stage II', '2', 'Spawned Toadlars', '25', 'The holes in the dam seem to be under control, but the Toadlar population most definitely is not. Kill those Toadlars before they overrun the dam!  ', '1000600', null, null, null, null, null, '8865', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('163', '41', 'Stage III', '2', 'Scregrath', '1', 'The Boglars are in league with an Gorger! Stop them before they rip the dam walls from their foundations!  ', '1000601', null, null, null, null, null, '8866', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('164', '41', 'Stage III', '2', 'Bignose Toadlar', '3', 'The Boglars are in league with an Gorger! Stop them before they rip the dam walls from their foundations!  ', '1000602', null, null, null, null, null, '8866', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('165', '42', 'Stage I', '2', 'Barak Varr Sea-Axes', '30', 'Dwarf forces have fallen back to defend this critical supply warehouse on Grundadrakk\'s Wharf! Slaughter the Barak Varr Sea-Axes who defend the warehouse!', '4189', null, null, null, null, null, '8076', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('166', '42', 'Stage II', '3', 'Set Fire to Supplies', '10', 'With the Dwarf\'s defense stalled, the way is cleared for the destruction of Dwarf supplies in the warehouse. Steal the supplies to undermine their continued war efforts!', '98790', null, null, null, null, null, '8077', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('167', '42', 'Stage III', '2', 'Kill Barak Varr Whitebeards', '5', 'The Dwarf forces return with their most grizzled warriors in an effort to salvage the supplies. Defeat them and prevent them from extinguishing the flames!', '32817', null, null, null, null, null, '8078', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('168', '42', 'Stage IV', '2', 'Anvar Steamhammer', '1', 'Anvar Steamhammer has had enough! Since the Whitebeards proved unequal to the task of saving Barak Varr, he\'s taken on the challenge himself. Slay the Dwarf leader and burn Grundadrakk\'s Wharf to the ground!', '32816', null, null, null, null, null, '8079', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('169', '43', 'Stage I', '2', 'Seahammer Dwarfs', '50', 'The ironclad Seahammer was docked in Barak Varr when the greenskin Waaagh! attacked. Admiral Sternbrow has stationed Seahammer Dwarfs topside to guard the entrances to the ship. Kill the Seahammer Dwarfs and board the ship!', '4480', '15312', '15321', '15314', null, null, '8080', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('170', '43', 'Stage II', '2', 'Seahammer Saltbeards', '4', 'As the last of the topside guards fall, an alarm sounds. Shouts and curses echo from within the vessel, as angry Saltbeard veterans storm out to the battle. Defeat them before they repel the greenskin attack!', '16630', null, null, null, null, null, '8081', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('171', '43', 'Stage III', '2', 'Admiral Sternbrow', '1', 'Admiral Sternbrow has come to stop the invasion of the greenskins himself. Slay Sternbrow to claim the Ironclad for the Waaagh!  ', '21024', null, null, null, null, null, '8082', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('172', '44', 'Stage I', '2', 'Barak Varr Dwarfs', '100', 'The defenders of Barak Varr have gathered at the Salty Beard Pub in an effort to stall the greenskin advance on the treasured tavern. Crush them all!  ', '15316', '7443', '4196', '15320', null, null, '8084', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('173', '44', 'Stage II', '2', 'Barak Varr Alekeepers', '4', 'Beerhaulers from the tavern emerge to rescue barrels of ale on the dock, so that the defenders may have a drink to revive their spirits. Prevent them from hauling the ale to safety inside the tavern and defeat the Alekeepers overseeing them.', '21021', null, null, null, null, null, '8085', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('174', '44', 'Stage II', '2', 'Beer Collected', '40', 'Beerhaulers from the tavern emerge to rescue barrels of ale on the dock, so that the defenders may have a drink to revive their spirits. Prevent them from hauling the ale to safety inside the tavern and defeat the Alekeepers overseeing them.', '0', null, null, null, null, null, '8085', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('175', '44', 'Stage III', '2', 'Brewmaster\'s Assistant', '1', 'The proprieter of the Barak Varr pub charges out to put a stop to the blasphemous waste of decent ale. Kill Mugs Firebrew and his Assistant to put an end to his pub!  ', '32744', null, null, null, null, null, '8086', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('176', '44', 'Stage III', '2', 'Mugs Firebrew', '1', 'The proprieter of the Barak Varr pub charges out to put a stop to the blasphemous waste of decent ale. Kill Mugs Firebrew and his Assistant to put an end to his pub!  ', '32742', null, null, null, null, null, '8086', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('177', '45', 'Stage I', '2', 'Kill Korgoth Gors', '100', 'The Karakshot Caravan was carrying much needed supplies to Bar Dawazbak when it was attacked by Korgoth raiders! Slaughter the raiders and recover those supplies!', '7343', null, null, null, null, null, '8848', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('178', '45', 'Stage I', '0', 'Recover Karakshot Crates', '5', 'The Karakshot Caravan was carrying much needed supplies to Bar Dawazbak when it was attacked by Korgoth raiders! Slaughter the raiders and recover those supplies!', '99671', null, null, null, null, null, '8848', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('179', '45', 'Stage II', '0', 'Karakshot Othbearers Lost', '10', 'A strangled horn sounds as the Korgoth Ambushers prepare for another attack. Protect the Karakshot Oathbearers and eliminate the Ambushers!', '99670', null, null, null, null, null, '8849', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('180', '45', 'Stage II', '2', 'Korgoth Ambusher', '20', 'A strangled horn sounds as the Korgoth Ambushers prepare for another attack. Protect the Karakshot Oathbearers and eliminate the Ambushers!', '1000622', null, null, null, null, null, '8849', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('181', '45', 'Stage III', '0', 'Destroy the Herdstone', '1', 'With the caravan secured, it\'s now time to press the advantage.  Destroy the Korgoth herdstone and their Shaman to force the Beastmen to scatter.  ', '568', null, null, null, null, null, '8850', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('182', '45', 'Stage III', '2', 'Korgoth Shaman', '5', 'With the caravan secured, it\'s now time to press the advantage.  Destroy the Korgoth herdstone and their Shaman to force the Beastmen to scatter.  ', '22704', null, null, null, null, null, '8850', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('183', '45', 'Stage IV', '2', 'Wargor Korgoth', '1', 'The destruction of the herdstone has awoken Wargor Korgoth. If left alive he will surely rebuild his herd. Slay the beast to rid Barak Varr of the Chaos presence.  ', '32849', null, null, null, null, null, '8851', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('184', '46', 'Stage I', '2', 'Murdogh Dwarfs', '50', 'Drive these interloping stunties out of the marsh! Sabotage their mission by thinning out their ranks.', '4351', '4349', null, null, null, null, '8056', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('185', '46', 'Stage II', '2', 'Dorin Redhammer', '1', 'The leader of the Murdogh Thunderers is reciting grudges owed the Oathbearers by the Black Skull clan. Kill that Dorin Redhammer before the stunties make up their minds to charge!', '4599', null, null, null, null, null, '8057', '0', '1', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('186', '46', 'Stage II', '2', 'Oathbearer Runesmiths', '2', 'The leader of the Murdogh Thunderers is reciting grudges owed the Oathbearers by the Black Skull clan. Kill that Dorin Redhammer before the stunties make up their minds to charge!', '0', null, null, null, null, null, '8057', '0', '1', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('187', '47', 'Stage I', '2', 'Tomb Minions', '30', 'The Liche, Agymah, has raised countless minions to guard the approach to his lair. Dispatch the Tomb Warriors, Tomb Sworn and Tomb Reapers to push through into the tomb!', '14813', '14808', null, null, null, null, '8868', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('188', '47', 'Stage II', '2', 'Defeat Tomb Guard', '8', 'Access to the depths of Agymah\'s Lair is blocked by his powerful Tomb Guards. Destroy them!', '1000893', '10600244', null, null, null, null, '8869', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('189', '47', 'Stage III', '11', 'Destroy the Casket Fragments', '5', 'Agymah\'s high priest Un\'Ankhar has begun a ritual designed to reunite shattered pieces of the Casket of Souls.  Destroy those fragments and eliminate him and his Tomb Priests before they can finish their ritual!', '99718', null, null, null, null, null, '8870', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('190', '47', 'Stage III', '2', 'Tomb Priests', '5', 'Agymah\'s high priest Un\'Ankhar has begun a ritual designed to reunite shattered pieces of the Casket of Souls.  Destroy those fragments and eliminate him and his Tomb Priests before they can finish their ritual!', '1083518', '', null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('191', '47', 'Stage IV', '2', 'Defeat Agymah', '1', 'The ritual to reunite the Casket of Souls was unsuccessful. Now all that remains is to defeat Agymah himself. Crush his Court and destroy the mighty liche before he marches on Oathhold!', '1000894', null, null, null, null, null, '8871', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('192', '48', 'Stage I', '2', 'Stop the Feeders', '75', 'The first wave of Oathbearers sent against Lord Neborhest have fallen to his undead minions. Destroy those that feed upon them, and collect the grudges so they may be recorded in the Book of Grudges!', '14817', null, null, null, null, null, '8872', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('193', '48', 'Stage I', '3', 'Collect the Grudges', '50', 'The first wave of Oathbearers sent against Lord Neborhest have fallen to his undead minions. Destroy those that feed upon them, and collect the grudges so they may be recorded in the Book of Grudges!', '436', null, null, null, null, null, '8872', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('194', '48', 'Stage II', '3', 'Destroy the Pillar of the Hunter', '1', 'The vampire\'s power is being channeled by the central pillars in the tower. Destroy those pillars and defeat his undead champion, Mattias von Jaeger.', '99726', null, null, null, null, null, '8873', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('195', '48', 'Stage II', '2', 'Defeat Mattias von Jaeger', '1', 'The vampire\'s power is being channeled by the central pillars in the tower. Destroy those pillars and defeat his undead champion, Mattias von Jaeger.', '1000585', null, null, null, null, null, '8873', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('196', '48', 'Stage III', '3', 'Destroy the Pillar of the Begrudged', '1', 'Neborhest\'s reach is not limited by race. All dead creatures fall under his command. Now he raises the great ironbreaker Norrison to face his own troops. Defeat the risen ironbreaker and destroy the pillar he guards!', '100133', null, null, null, null, null, '8874', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('197', '48', 'Stage III', '2', 'Defeat Norrisson', '1', 'Neborhest\'s reach is not limited by race. All dead creatures fall under his command. Now he raises the great ironbreaker Norrison to face his own troops. Defeat the risen ironbreaker and destroy the pillar he guards!', '1000586', null, null, null, null, null, '8874', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('198', '48', 'Stage IV', '3', 'Destroy the Pillar of Rage', '1', 'Undeterred by the defeat of two champions, Neborhest brings forth the most ferocious beast under his command. Defeat the infamous Dork Redeye and shatter the final pillar fueling the vampire\'s power!', '99725', null, null, null, null, null, '8875', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('199', '48', 'Stage IV', '2', 'Defeat Dork Redeye', '1', 'Undeterred by the defeat of two champions, Neborhest brings forth the most ferocious beast under his command. Defeat the infamous Dork Redeye and shatter the final pillar fueling the vampire\'s power!', '1000587', null, null, null, null, null, '8875', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('200', '48', 'Stage V', '2', 'Neborhest', '1', 'The vampire\'s lair is cluttered with the piles of decomposing victim and servant alike. Slay the abomination known as Neborhest and end his rule over the Marshes of Madness!  ', '1000588', null, null, null, null, null, '9999', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('201', '49', 'Stage I', '2', 'Soulless Minions', '125', 'The army of Lord Neborhest gathers to march on Oathhold!  Cut down the Soulless Minions to protect the Dwarf camp!', '14810', null, null, null, null, null, '8876', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('202', '49', 'Stage II', '2', 'Dwarfs Slain', '30', 'The ground moans, heralding the onslaught of Neborhest\'s unholy vanguard.  Stop their charges before the Oathbearer defenders are trampled.', '1000589', null, null, null, null, null, '8877', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('203', '49', 'Stage III', '2', 'Defeat Petrova the Bloodless', '1', 'The thrall of Neborhest is raising dead for a massive charge!  Defeat Petrova the Bloodless and shatter Neborhest\'s Vanguard!', '1000590', null, null, null, null, null, '8878', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('204', '50', 'Stage I', '2', 'Grundadrakk Grudgerladen', '40', 'King Byrrnoth Grundadrakk has dispatched a regiment of Dwarfs to signal for aid from the lighthouse on Ironrock Point. Kill the Grundadrakk Grudgerladen to clear a path to the lighthouse!', '20899', '20890', null, null, null, null, '8088', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('205', '50', 'Stage II', '2', 'Defend Lobber Crew', '5', 'The Dwarf regiment dispatched to Ironrock Point came with more than just fiery tempers and sharp axes. Grundadrakk Siegers have begun attacking the Bloody Sun rock lobbers.  Keep those lobbers firing on the ironclad and the lighthouse!', '20887', null, null, null, null, null, '8089', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('206', '50', 'Stage III', '2', 'Drundig Garlesson', '1', 'His lighthouse at risk, Drundig Garlesson joins his troops at the lighthouse\'s base. Defeat the Dwarf leader and scatter his forces!  ', '20896', null, null, null, null, null, '8090', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('207', '51', 'Stage I', '2', 'Slayer Pirates', '75', 'The Fair Fregar II sits at anchor within Slayer Cove. All that stands between the Bloody Sun Waaagh! and a ship full of trophies is a mob of bare-chested, orange haired Dwarfs. Slaughter the Slayer Pirates and charge their ship!  ', '20900', null, null, null, null, null, '8092', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('208', '51', 'Stage II', '2', 'Grudges Accumulated', '60', 'Long Drong will only battle against those he considers capable of besting him. Draw his wrath by killing his Slayers or stealing his rum. Be sure to avoid death, however, as that will reduce the grudges he\'s collecting!', '0', null, null, null, null, null, '8093', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('209', '51', 'Stage III', '2', 'Long Drong the Slayer Pirate', '1', 'Long Drong the Slayer Pirate roars a Dwarf challenge as he charges the Bloody Sun greenskins. The Slayer Pirate leader must be defeated before his ship can be claimed!  ', '33078', null, null, null, null, null, '8094', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('210', '52', 'Stage I', '2', 'Kill Grundadrakk Dwarfs', '125', 'King Byrrnoth Grundadrakk\'s ironclad has been forced aground on the Barak Varr shoreline, with him still aboard. Take out all the Dwarfs who stand between the Bloody Sun Waaagh! and the king of Barak Varr!  ', '0', null, null, null, null, null, '8096', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('211', '52', 'Stage II', '2', 'Kill Grundadrakk Honor Guard', '5', 'The King\'s Honor Guard has disembarked to secure the beach for the King\'s arrival. Destroy them!  ', '3854', null, null, null, null, null, '8097', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('212', '52', 'Stage III', '2', 'Defeat Grugnis Grundisson', '1', 'The quarry the Bloody Sun Boyz sought has finally come to fight! Defeat King Byrrnoth Grundadrakk and his trusted guards Hargar Stonebearer and Grugnis Grundisson!', '26067', null, null, null, null, null, '8098', '0', '1', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('213', '52', 'Stage III', '2', 'Defeat Hargar Stonebearer', '1', 'The quarry the Bloody Sun Boyz sought has finally come to fight! Defeat King Byrrnoth Grundadrakk and his trusted guards Hargar Stonebearer and Grugnis Grundisson!', '26066', null, null, null, null, null, '8098', '0', '1', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('214', '52', 'Stage III', '2', 'Defeat King Byrrnoth Grundadrakk', '1', 'The quarry the Bloody Sun Boyz sought has finally come to fight! Defeat King Byrrnoth Grundadrakk and his trusted guards Hargar Stonebearer and Grugnis Grundisson!', '26068', null, null, null, null, null, '8098', '0', '1', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('215', '53', 'Stage I', '2', 'Gassy Mines Inhabitants', '30', 'The Waaagh! reaches the Dwarf mines of Thardrik. Disrupt their operation here by destroying mining valves and supplies, and killing any workers found within.', '35764', '35257', null, null, null, null, '8100', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('216', '53', 'Stage I', '11', 'Mining Supplies Destroyed', '15', 'The Waaagh! reaches the Dwarf mines of Thardrik. Disrupt their operation here by destroying mining valves and supplies, and killing any workers found within.', '98849', null, null, null, null, null, '8100', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('217', '53', 'Stage I', '11', 'Mining Valves Destroyed', '10', 'The Waaagh! reaches the Dwarf mines of Thardrik. Disrupt their operation here by destroying mining valves and supplies, and killing any workers found within.', '98850', null, null, null, null, null, '8100', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('218', '53', 'Stage II', '2', 'Thardrik Tinkerers', '10', 'Dwarven tinkerers race into the mines of Thardrik to fix the broken valves before the mine collapses. Kill them before they are able to complete the repairs.', '36413', null, null, null, null, null, '8101', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('219', '53', 'Stage III', '2', 'Ironbreaker Burrowrock', '1', 'The guardian of the mine, Ironbreaker Burrowrock, emerges from the collapsed depths to face the invaders. Kill him.', '36411', null, null, null, null, null, '8102', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('220', '54', 'Stage I', '2', 'Rallying Thardriksson', '100', 'The Dwarfs of Thardrik rally around the statue of their founder for inspiration. Kill them before they bolster their forces.', '34656', null, null, null, null, null, '8104', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('221', '54', 'Stage II', '2', 'Thardrik Beardrouser', '2', 'Beardrousers arrive to inspire the others with tales of bravery against impossible odds, much like this Waaagh! Fabricated stories or not, the Beardrousers should be smashed along with any citizens they have inspired.', '35871', null, null, null, null, null, '8105', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('222', '54', 'Stage III', '2', 'Thardrik Hammer Guards', '10', 'The Waaagh! now faces the statue\'s last line of defense: Lord Thardrik\'s personal guards. Leave none standing.', '35209', null, null, null, null, null, '8106', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('223', '54', 'Stage IV', '2', 'Lord Thardrik', '1', 'Refusing to accept defeat even in his final hour, Lord Thardrik stands up to the greenskins in a valiant display of martial prowess. Defeat him.', '36179', null, null, null, null, null, '8107', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('224', '55', '', '3', 'Fires Set in North Buildings', '10', 'The greenskins have managed to sieze enough ground for a goblin to set up a bonfire in the middle of Thardrik.  Collect embers from the fires and then use them in the Dwarf buildings to set the town ablaze.', '39', null, null, null, null, null, '8109', '0', '0', '0', '1', '1');
