INSERT INTO `pquest_objectives` VALUES ('227', '55', 'Stage I', '2', 'Thardrik Citizens', '100', 'The Waaagh! has made it to the mountain pass town of Thardrik.  Kill everyone here.', '35211', '35205', '34601', '35206', null, null, '8108', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('228', '55', 'Stage V', '2', 'Slaughter the Goldhammers', '3', 'The commander of the Dwarf brigade leads a final desperate charge.  Her temerity may win the day yet.  Gruna Goldhammer and her sons must be slain.', '36352', null, null, null, null, null, '0', '0', '0', '0', '1', '1');
