INSERT INTO `pquest_objectives` VALUES ('242', '59', 'Stage III', '2', 'Ironrock Grenadiers', '8', 'The engine of a gyrocopter hums through the air as Thorar Ironrock arrives on a nearby landing pad. Kill him and the defense of Bar Dawazbak will be crushed for good!', '3282', null, null, null, null, null, '8066', '0', '0', '0', '1', '1');
