INSERT INTO `pquest_objectives` VALUES ('244', '63', 'Stage I', '2', 'Moonfang Goblins', '175', 'Goblins have gathered in mass for some purpose. Whatever it is the mob must be dealt with. Kill them.', '4707', null, null, null, null, null, '8892', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('245', '63', 'Stage II', '2', 'Gobhead Squigbringa', '1', 'The crazed Goblin Gobhead races onto the scene with his ravenous squigs. He must be stopped before his frenzied movement overruns the Waaagh!', '1000695', null, null, null, null, null, '8893', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('246', '64', 'Stage I', '2', 'Exiled Mutants', '30', 'A group of exiled mutants have taken refuge here to practice their perverse arts. They inadvertently picked a fight with straggler greenskins. Now they have to deal with the Waaagh! Wipe them out.', '34226', null, null, null, null, null, '8120', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('247', '64', 'Stage II', '11', 'Destroy Chaos Stones in The Cave', '5', 'The malformed humans have begun using the corrupt stones to augment their strength. Destroy the source of their power: the Chaos Stones.', '98870', null, null, null, null, null, '8121', '0', '0', '0', '1', '1');
