INSERT INTO `pquest_objectives` VALUES ('249', '64', 'Stage III', '2', 'Exiled Summoners', '4', 'The exiled mutants harness their collective power and summon forth a pestilent beast to deal with the greenskins. Destroy it and those who brought it forth.', '36219', null, null, null, null, null, '8122', '0', '0', '0', '1', '1');
