INSERT INTO `pquest_objectives` VALUES ('251', '65', 'Stage I', '2', 'Bloody Sun Raidas', '70', 'After a surprise attack, the Oathbearers were forced out of their main supply camp, which is critical to success in the Badlands. Enter the camp, drive out the invading greenskins and recover the supplies!', '35006', null, null, null, null, null, '8896', '0', '0', '0', '1', '1');
