INSERT INTO `pquest_objectives` VALUES ('257', '66', 'Stage I', '2', 'Kill Blue Face Stunty Killas', '100', 'Blue-Face greenskins have gathered to complete a shamanistic ritual for use against the Dwarfs. They must be stopped!', '34210', null, null, null, null, null, '8880', '0', '0', '0', '1', '1');
