INSERT INTO `pquest_objectives` VALUES ('263', '67', 'Stage I', '2', 'Warpclaw Clanrats', '30', 'Phineas Fireforge passed through Kazad Drung in his great brightstone expedition years ago. Retracing his steps to the precious ore, the Oathbearers have encountered Kazad Drung\'s new inhabitants. Destroy them!', '34941', null, null, null, null, null, '8884', '0', '0', '0', '1', '1');
