INSERT INTO `pquest_objectives` VALUES ('280', '70', 'Stage I', '2', 'Altstadt Citizens', '100', 'These citizens of Altstadt think they can succeed in stalling the advance of the Waaagh! Crush them all!', '34511', '34509', '37154', null, null, null, '8136', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('281', '70', 'Stage II', '3', 'Claim Altstad buildings', '6', 'The Altstadt citizenry is falling back under the relentless assault of the greenskins! It is now time to lay claim to the town. Claim the buildings by placing banners in the piles of dirt at their bases.', '98880', null, null, null, null, null, '8137', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('282', '70', 'Stage II', '2', 'Kill Sigmarite Faithsworn', '10', 'The Altstadt citizenry is falling back under the relentless assault of the greenskins! It is now time to lay claim to the town. Claim the buildings by placing banners in the piles of dirt at their bases.', '36185', null, null, null, null, null, '8137', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('283', '70', 'Stage III', '2', 'Kill Vorn the Faithful', '1', 'A champion warrior priest on pilgrimage has arrived to find Altstadt in ruins. Kill him to gain complete control over the village!', '37161', null, null, null, null, null, '8138', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('284', '70', 'Stage IV', '11', 'Destroy Statue of Sigmar', '1', 'It is now time for Bloody Sun Greenskins to take control of this village. Destroy the Statue of Sigmar to make disappear any hope that could still remain into Altstadt defender.', '532', null, null, null, null, null, '8139', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('285', '71', 'Stage I', '2', 'Pilgrims and Priests', '30', 'Sigmarites gather here in the shadow of their temple, a resting place on their pilgrimage. Show them that nowhere is safe from the Waaagh! Kill all you find!', '35436', null, null, null, null, null, '8140', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('286', '71', 'Stage I', '2', 'Sigmarite Truth-Hammer', '15', 'Sigmarites gather here in the shadow of their temple, a resting place on their pilgrimage. Show them that nowhere is safe from the Waaagh! Kill all you find!', '35429', null, null, null, null, null, '8140', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('287', '71', 'Stage II', '2', 'Sigmarite Truthbringers', '5', 'Defenders on horseback countercharge the invading greenskins. The town can not be fully claimed until they are dealt with. Kill the Sigmarite Truthbringers and their mounts!', '37156', null, null, null, null, null, '8141', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('288', '71', 'Stage II', '2', 'Warhorses', '5', 'Defenders on horseback countercharge the invading greenskins. The town can not be fully claimed until they are dealt with. Kill the Sigmarite Truthbringers and their mounts!', '37156', null, null, null, null, null, '8141', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('289', '71', 'Stage III', '3', 'Drink the Sacramental Wine', '1', 'Brochus the Truthful, the strongest of faith among the Sigmarites, rises from the dwindling ranks to champion a desperate defense against the greenskins. Finish him off and the Waaagh! will continue on!', '100260', null, null, null, null, null, '8142', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('290', '71', 'Stage III', '2', 'Brochus the Truthful', '1', 'Brochus the Truthful, the strongest of faith among the Sigmarites, rises from the dwindling ranks to champion a desperate defense against the greenskins. Finish him off and the Waaagh! will continue on!', '37159', null, null, null, null, null, '8142', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('291', '72', 'Stage I', '2', 'Penitent Inquisitor', '40', 'The Waaagh! has made it to the precious historical site dedicated to Sigmar\'s ancient pact with the Dwarfs. Desecrating this place will be a moral blow to both armies. Start by killing the Penitents and the Inquisitors.', '35851', null, null, null, null, null, '8144', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('292', '72', 'Stage I', '2', 'Sigmarite Penitent', '40', 'The Waaagh! has made it to the precious historical site dedicated to Sigmar\'s ancient pact with the Dwarfs. Desecrating this place will be a moral blow to both armies. Start by killing the Penitents and the Inquisitors.', '35852', null, null, null, null, null, '8144', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('293', '72', 'Stage II', '2', 'Sigmarite Champions', '10', 'Champions of Sigmar emerge from the temple to face the Waaagh! Kill them.', '34665', null, null, null, null, null, '8145', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('294', '72', 'Stage III', '2', 'Sigmarite Vanquishers', '5', 'Filled with righteous fury, the Sigmarite Vanquishers descend upon the unruly ranks of greenskins. The Waaagh! must force its way through the zealous fighters further into the temple.', '37158', null, null, null, null, null, '8146', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('295', '72', 'Stage V', '2', 'Sigmund the Prophet', '1', 'The Sigmarite Prophet prepares a ritual with relics said to be from Sigmar himself.  If successful, its power will be enough to eradicate the greenskin invaders. Sigmund must be stopped lest he destroy the Waaagh!', '37152', null, null, null, null, null, '8147', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('296', '73', 'Stage I', '2', 'Bloody Sun Bommas', '125', 'Grimbeard Station is critical to supplying the war efforts.  The Oathbearers must answer the Bloody Sun assault on the train station with hammer and axe.', '10054', '1116', null, null, null, null, '8908', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('297', '73', 'Stage II', '2', 'Bloody Sun Sappas', '10', 'A shipment of critical war supplies spilled out during the conflict over the station.  The Oathbearers must reclaim the goods quickly before the greenskins destroy them.', '1000754', null, null, null, null, null, '8909', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('298', '73', 'Stage II', '3', 'Destroy the Track Supplies', '20', 'A shipment of critical war supplies spilled out during the conflict over the station.  The Oathbearers must reclaim the goods quickly before the greenskins destroy them.', '100644', null, null, null, null, null, '8909', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('299', '73', 'Stage III', '2', 'Gutcutta da Bomma', '1', 'Gutcutta da Bomma and Kruncha da Big Bomma are the greenskins behind the destruction of Grimbeard Station.  They must be stopped before the station is beyond repair.', '1000755', null, null, null, null, null, '8910', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('300', '73', 'Stage III', '2', 'Kruncha da Big Bomma', '1', 'Gutcutta da Bomma and Kruncha da Big Bomma are the greenskins behind the destruction of Grimbeard Station.  They must be stopped before the station is beyond repair.', '1000756', null, null, null, null, null, '8910', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('301', '74', 'Stage I', '2', 'Kill Moonfang Goblins', '30', 'A remnant of goblins has infested Black Fire Pass.  The Moonfang Waaagh! has to be stopped before it grows.  Kill them and the accompanying arachnids.', '0', null, null, null, null, null, '8904', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('302', '74', 'Stage I', '2', 'Kill Moonfang Arachnids', '20', 'A remnant of goblins has infested Black Fire Pass.  The Moonfang Waaagh! has to be stopped before it grows.  Kill them and the accompanying arachnids.', '35351', null, null, null, null, null, '8904', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('303', '74', 'Stage II', '2', 'Destrroy Moonfang Banners', '10', 'In a frantic manner, the goblins erect banners in seemingly random places throughout the cave. Let them know they are unwelcome in Black Fire Pass by destroying the Moonfang Banners.', '35982', null, null, null, null, null, '8905', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('304', '74', 'Stage III', '2', 'Kill Grogaf Spidablood', '1', 'The leader of the Moonfang tribe arrives to deal with the Bloody Sun Boyz.  Kill him and his minion.', '37522', null, null, null, null, null, '8906', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('305', '74', 'Stage III', '2', 'Kill Orakrix the Sunderer', '1', 'The leader of the Moonfang tribe arrives to deal with the Bloody Sun Boyz.  Kill him and his minion.', '0', null, null, null, null, null, '8906', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('306', '75', 'Stage I', '2', 'Kolaz Umgal Dwarfs', '125', 'Kolaz Umgal is defended by some of the strongest Dwarf forces in Black Fire Pass. Conquering this fortress would be an excellent display of greenskin strength, and it begins by cutting down the main force stationed here.  ', '35522', '35519', '35830', '35517', null, null, '8132', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('307', '75', 'Stage II', '3', 'Blacksmithing Resources Gathered', '25', 'Armor and weaponsmiths are attempting to gather enough resources from the mine in the lower fortress to craft Thane\'s Glorious Hammer and the Platemail of Kolaz Umgal. They must be stopped.  ', '98884', '98881', null, null, null, null, '8133', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('308', '75', 'Stage III', '2', 'Prevent the Sigmarite Warrior Priests from Entering Tower', '5', 'Sigmarite Warrior Priests, at the behest of the Sigmar Embassy, have arrived at the main gates of Kolaz Umgal, intent on making their way to the tower to join the Dwarf leader in battle. Defeat them before they reach the tower door!  ', '35827', null, null, null, null, null, '8134', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('309', '75', 'Stage IV', '2', 'Forgrin Steelforge', '1', 'The Dwarf Captain, Forgrin Steelforge, has left his tower to preside over the final defense of the fortress himself. Kill him and claim Kolaz Umgal for the Waaagh!  ', '35826', null, null, null, null, null, '8135', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('310', '79', 'Stage 0', '0', 'Follow Dieter Vorkwald', '1', 'Dieter Vorkwald has succesfully completed his ritual of cleansing.  Follow him back to the town square.  ', '0', null, null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('311', '79', 'Stage I', '2', 'Warpclaw Looters', '125', 'Hindelburg is burning! Skaven have overrun the Empire town, and the Oathbearers are honor bound to cleanse the vermin. Slay the Warpclaw Looters and save the town!', '35752', null, null, null, null, null, '8912', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('312', '79', 'Stage II', '6', 'Protect Dieter Vorkwald', '1', 'A Priest of Shallya has been summoned to cleanse the town.  He should be arriving at the city gates soon.  Protect him on his way.', '0', null, null, null, null, null, '8913', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('313', '79', 'Stage III', '2', 'Warpclaw Rat Ogres', '12', 'Skaven bring their Warpclaw Rat Ogres to bear against the Dwarfs.  They and the slavemasters that guide them must be stopped, and Dieter must be protected.  The fate of Hindelburg hangs in the balance!', '0', null, null, null, null, null, '8914', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('314', '79', 'Stage III', '2', 'Warpclaw Packmasters', '6', 'Skaven bring their Warpclaw Rat Ogres to bear against the Dwarfs.  They and the slavemasters that guide them must be stopped, and Dieter must be protected.  The fate of Hindelburg hangs in the balance!', '1000897', null, null, null, null, null, '8914', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('315', '79', 'Stage III', '6', 'Protect Dieter Vorkwald', '1', 'Skaven bring their Warpclaw Rat Ogres to bear against the Dwarfs.  They and the slavemasters that guide them must be stopped, and Dieter must be protected.  The fate of Hindelburg hangs in the balance!', '0', null, null, null, null, null, '8914', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('316', '79', 'Stage IV', '6', 'Protect Dieter Vorkwald', '1', 'The priest prepares a desperate ritual in hopes Shallya will answer the prayers of her people and drive off the warped vermin.  His only chance at success is in the Dwarfs being able to protect him while he cleanses the town.', '0', null, null, null, null, null, '8915', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('317', '79', 'Stage V', '2', 'Clawmaster Skritchak', '1', 'Shallya\'s priest cleansed the town of all but the strongest Skaven.  The Oathbearers must not let the priest\'s death be in vain.  Kill Clawmaster Skritchak!', '1000896', null, null, null, null, null, '9998', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('318', '80', 'Stage I', '2', 'Moonfang Goblins', '175', 'Goblins have gathered in mass for some purpose. Whatever it is the mob must be dealt with. Kill them.', '4705', null, null, null, null, null, '8116', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('319', '80', 'Stage II', '2', 'Gobhead Squigbreeda', '1', 'The crazed Goblin Gobhead races onto the scene with his ravenous squigs. He must be stopped before his frenzied movement overruns the Waaagh!', '1000695', null, null, null, null, null, '8117', '0', '1', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('320', '81', 'Stage I', '2', 'Oathbearer Denizens', '70', 'The Dwarfs are on their heels after being surprised by the greenskin attack. Drive them off the plateau and destroy all their supplies to cripple their advance through the Badlands.', '15109', null, null, null, null, null, '8112', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('321', '81', 'Stage I', '11', 'Destroy Recoverd Supply Crates', '40', 'The Dwarfs are on their heels after being surprised by the greenskin attack. Drive them off the plateau and destroy all their supplies to cripple their advance through the Badlands.', '494', null, null, null, null, null, '8112', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('322', '81', 'Stage II', '2', 'Oathbearer Master Gunners', '8', 'Oathbearer Master Gunners have arrived in full force to assist in reclaiming the camp. The Bloody Sun Boyz will have to kill the lot of them to if they wish to push the Dwarfs off the plateau.  ', '36469', null, null, null, null, null, '8113', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('323', '81', 'Stage III', '2', 'Oathbearer Sharpshooter', '4', 'The leader of the Dwarf regiment charges the greenskin line in a daring attempt to reclaim the camp. Kill Thane Grofsson and his sharpshooter escorts to shatter the Oathbearers\' hopes of recovering their supply camp.   ', '36470', null, null, null, null, null, '8114', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('324', '81', 'Stage III', '2', 'Thane Grofsson', '1', 'The leader of the Dwarf regiment charges the greenskin line in a daring attempt to reclaim the camp. Kill Thane Grofsson and his sharpshooter escorts to shatter the Oathbearers\' hopes of recovering their supply camp.   ', '36467', null, null, null, null, null, '8114', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('325', '83', 'Stage I', '2', 'Ritualists and Cultists', '100', 'The vile cult here has been spreading corruption throughout the area, interfering with greenskin efforts to secure the pass. See to it that they trouble the Waaagh! no more!', '35919', '34541', null, null, null, null, '8148', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('326', '83', 'Stage I', '2', 'Nurglings', '50', 'The vile cult here has been spreading corruption throughout the area, interfering with greenskin efforts to secure the pass. See to it that they trouble the Waaagh! no more!', '1424', '1000863', null, null, null, null, '8148', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('327', '83', 'Stage II', '2', 'Suppress the Cultists\' Ritual', '4', 'The humans are attempting a ritual intended to grant them aid against the Waaagh! Kill the Catechists to disrupt it.', '37634', null, null, null, null, null, '8149', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('328', '83', 'Stage III', '2', 'Blighted Plaguebeast', '1', 'The human cultists have managed to summon forth a beast of pestilence.  The Waaagh! should crush it too.', '34046', null, null, null, null, null, '8150', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('329', '84', 'Stage I', '2', 'Blighted Beastmen', '125', 'The beastmen have been ambushing greenskins who are attempting to join the Waaagh! Put an end to their interference and kill all you see!', '35924', '34653', '35904', null, null, null, '8152', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('330', '84', 'Stage II', '11', 'Destroy the Herdstone', '1', 'The Shamans of this Beastman tribe garner their power from the Herdstone at the center of their camp. Destroy it and weaken their hold on the area!', '568', null, null, null, null, null, '8153', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('331', '84', 'Stage II', '0', 'Blighted Gor Shaman', '10', 'The Shamans of this Beastman tribe garner their power from the Herdstone at the center of their camp. Destroy it and weaken their hold on the area!', '35917', null, null, null, null, null, '8153', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('332', '84', 'Stage III', '2', 'Kill Valraz the Plagued', '1', 'Valraz the Plagued has come to slaughter the greenskins who have destroyed his tribe\'s Herdstone. Defeat him and put an end to these Beastmen!', '61551', null, null, null, null, null, '8154', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('333', '85', 'Stage I', '2', 'Kolaz Umgal Steelshot', '20', 'The Dwarfs have dispatched Ranger forces to deal with the beastmen and cultist presence in the area, but now they are interfering with the Waaagh! Kill them all!  ', '34536', null, null, null, null, null, '8156', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('334', '85', 'Stage I', '2', 'Kolaz Umgal Stoneguard', '20', 'The Dwarfs have dispatched Ranger forces to deal with the beastmen and cultist presence in the area, but now they are interfering with the Waaagh! Kill them all!  ', '35440', null, null, null, null, null, '8156', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('335', '85', 'Stage II', '3', 'Burn Dwarf Tents', '10', 'The Waaagh! has trampled the forces of the Kazdor Rangers. Now it is time to destroy their camp.  Defend the Bloody Sun Burna as he travels to each of the camp sites to set them ablaze.', '100119', null, null, null, null, null, '8157', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('336', '85', 'Stage II', '0', 'Bloody Sun Burna Died', '1', 'The Waaagh! has trampled the forces of the Kazdor Rangers. Now it is time to destroy their camp.  Defend the Bloody Sun Burna as he travels to each of the camp sites to set them ablaze.', '0', null, null, null, null, null, '8157', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('337', '85', 'Stage III', '2', 'Kill Thulgrim Hurlesson ', '1', 'The ranger leader, Thulgrim Hurlesson, and his entourage return from their watch to find the camp in ruins. They now move to confront the greenskin Waaagh! Kill them!', '42744', null, null, null, null, null, '8158', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('338', '85', 'Stage III', '2', 'Kill Kolaz Umgal Ironguards', '2', 'The ranger leader, Thulgrim Hurlesson, and his entourage return from their watch to find the camp in ruins. They now move to confront the greenskin Waaagh! Kill them!', '1000862', null, null, null, null, null, '8158', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('339', '86', 'Stage I', '2', 'Despoiled Revenants', '125', 'Ravenous Ghouls have emerged from the tar pits to gnaw on the remains of those who fell in the recent battle.The Oathbearers can not allow such disgrace to continue. Destroy the vile undead Revenants!', '34662', null, null, null, null, null, '8916', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('340', '86', 'Stage II', '2', 'Defeat Putrid Nightmares', '3', 'The ancient tar pits are littered with the remains of many creatures. An unknown master has animated these remains into vicious Nightmares. Destroy these powerful beasts!', '1000713', null, null, null, null, null, '8917', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('341', '86', 'Stage III', '2', 'Marcus Lieben', '1', 'Marcus Lieben, the necromancer behind the undead assault emerging from the tar pits, has come to destroy the Oathbearers interfering with his rituals. Defeat him to end the threat from the undead army!', '1000714', null, null, null, null, null, '8918', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('342', '86', 'Stage III', '2', 'Thelamadras', '1', 'Marcus Lieben, the necromancer behind the undead assault emerging from the tar pits, has come to destroy the Oathbearers interfering with his rituals. Defeat him to end the threat from the undead army!', '1000715', '', '', '', '', '', '8918', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('343', '87', 'Stage I', '2', 'Kill Blue Face Orcs', '25', 'The Bloody Sun Boyz are bolstering their ranks with the Savage Orcs of the Badlands. The Oathbearers must break up the greenskin mob before it can charge into battle!', '35111', null, null, null, null, null, '8920', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('344', '87', 'Stage I', '2', 'Kill Bloody Sun Boyz', '15', 'The Bloody Sun Boyz are bolstering their ranks with the Savage Orcs of the Badlands. The Oathbearers must break up the greenskin mob before it can charge into battle!', '35002', null, null, null, null, null, '8920', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('345', '87', 'Stage II', '2', 'Kill Bloody Sun Neckbreakas', '10', 'As long as the malodorous idols of the greenskins remain intact, there remains the possibility that there may be a counterattack. Destroy the effigies and any who are foolish enough to guard them!', '1000718', null, null, null, null, null, '8921', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('346', '87', 'Stage II', '2', 'Destroy Greenskin Idols', '5', 'As long as the malodorous idols of the greenskins remain intact, there remains the possibility that there may be a counterattack. Destroy the effigies and any who are foolish enough to guard them!', '0', null, null, null, null, null, '8921', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('347', '87', 'Stage III', '2', 'Grumgul Fistsmasha', '1', 'The leader of the Savage Orcs, Grumgul Fistmsha, angered by the failure of his boyz to protect the camp, emerges to meet the Dwarf invasion head on. His death would certainly cripple the Bloody Sun Boyz attempt to bolster their ranks here.  ', '1000720', null, null, null, null, null, '8922', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('348', '87', 'Stage III', '2', 'Bloody Sun Healas', '2', 'The leader of the Savage Orcs, Grumgul Fistmsha, angered by the failure of his boyz to protect the camp, emerges to meet the Dwarf invasion head on. His death would certainly cripple the Bloody Sun Boyz attempt to bolster their ranks here.  ', '1000719', null, null, null, null, null, '8922', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('349', '88', 'Stage I', '2', 'Open Withered Sarcophagi', '20', 'The Dwarfs have discovered an ancient burial chamber in which dark energies emanate from the many sarcophagi. Open these Withered Sarcophagi and destroy whatever terrible force resides within them!', '36320', null, null, null, null, null, '8924', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('350', '88', 'Stage I', '2', 'Kill Followers of Kali\'Amon', '60', 'The Dwarfs have discovered an ancient burial chamber in which dark energies emanate from the many sarcophagi. Open these Withered Sarcophagi and destroy whatever terrible force resides within them!', '99765', null, null, null, null, null, '8924', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('351', '88', 'Stage II', '2', 'Kill Risen Haruspices of Kali\'Amon', '10', 'The Dwarfs find themselves surrounded by the awakened servants of Kali\'Amon. Destroy his Haruspices as they attempt to rouse their lord from his slumber.', '1000721', null, null, null, null, null, '8925', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('352', '88', 'Stage III', '2', 'Kill Kali\'Amon ', '1', 'The ancient lord of this forgotten tomb, Kali\'Amon, has arisen to destroy those who would interfere with his plans for conquest. Destroy him and prevent him from spreading his forces through the world!', '1000722', null, null, null, null, null, '8926', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('353', '91', 'Stage I', '2', 'Bloody Sun Greenskins', '125', 'The greenskin raids have caused much havoc, and it\'s time to push them back. Slay the invaders and recover the supplies critical to the success of the war effort!', '1553', null, null, null, null, null, '8940', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('354', '91', 'Stage I', '3', 'Secure Dwarf Supply Crates', '50', 'The greenskin raids have caused much havoc, and it\'s time to push them back. Slay the invaders and recover the supplies critical to the success of the war effort!', '99277', null, null, null, null, null, '8940', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('355', '91', 'Stage II', '2', 'Oathbearer Freightmasters Slain', '10', 'Another caravan has arrived during the reclamation efforts, and must be seen to safety. Guard these Dwarfs with your life.', '1000758', null, null, null, null, null, '8941', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('356', '91', 'Stage III', '2', 'Ghutoof da Hunta', '1', 'The leaders of the raiding party arrive to end the Dwarf assault. Defeat the leaders to end the threat to the Dwarf supply lines for good!', '1000760', null, null, null, null, null, '8942', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('357', '91', 'Stage III', '2', 'Nadarg Eadsplitta', '1', 'The leaders of the raiding party arrive to end the Dwarf assault. Defeat the leaders to end the threat to the Dwarf supply lines for good!', '1000761', null, null, null, null, null, '8942', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('358', '91', 'Stage III', '0', 'Weird Wahgez', '1', 'The leaders of the raiding party arrive to end the Dwarf assault. Defeat the leaders to end the threat to the Dwarf supply lines for good!', '0', null, null, null, null, null, '8942', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('359', '92', 'Stage I', '2', 'Uthorin and Bloody Sun Forces', '100', 'The greenskins find that they must share their camp with the recently arrived Dark Elves, sent by Lord Uthorin to oversee their conquest of Kadrin. Defeat them both, and make clear that Karaz-A-Karak will fall to no one!', '1926', null, null, null, null, null, '8944', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('360', '92', 'Stage I', '2', 'Uthorin Deceiver', '25', 'The greenskins find that they must share their camp with the recently arrived Dark Elves, sent by Lord Uthorin to oversee their conquest of Kadrin. Defeat them both, and make clear that Karaz-A-Karak will fall to no one!', '4824', null, null, null, null, null, '8944', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('361', '92', 'Stage II', '2', 'Hurhur Tuskmaul', '1', 'Dwarfs are hewn in two as Hurhur Tuskmaul charges into the fray.  If the Dwarfs can prevail against this beast then perhaps there is hope after all.  ', '1000764', null, null, null, null, null, '8945', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('362', '92', 'Stage III', '2', 'Jevrisa', '1', 'Jevrisa has been pulling the strings all along.  Her death will seal both their races\' fates.  ', '1000762', null, null, null, null, null, '8946', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('363', '92', 'Stage III', '2', 'Athar Dreadsteel', '1', 'Jevrisa has been pulling the strings all along.  Her death will seal both their races\' fates.  ', '1000763', null, null, null, null, null, '8946', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('364', '93', 'Stage I', '2', 'Weeping Sore Cultists', '30', 'The Weeping Sore cultists must be killed before their plague and pestilence spreads to the entire valley.  ', '6977', null, null, null, null, null, '8948', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('365', '93', 'Stage II', '2', 'Sore-Ridden Plaguebearer', '3', 'The plague cauldrons are surrounded by an ill aura.  The Dwarfs must destroy them lest they continue to spread their contagion.', '1000770', null, null, null, null, null, '8949', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('366', '93', 'Stage II', '2', 'Plague Cauldrons', '3', 'The plague cauldrons are surrounded by an ill aura.  The Dwarfs must destroy them lest they continue to spread their contagion.', '1000771', null, null, null, null, null, '8949', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('367', '93', 'Stage III', '2', 'Contagion the Blighted', '1', 'Contagion the Blighted stands ready to reap the souls of the Dwarfs.  His death will put an end to the plague.  ', '38917', null, null, null, null, null, '8950', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('368', '94', 'Stage I', '2', 'Morkfang Greenskins', '60', 'The Madgits dance around the effigies of Gork, channeling magical energy while the Madboyz stand at the ready to engage all enemies. Slay them all!', '5794', '5820', null, null, null, null, '8160', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('369', '94', 'Stage II', '2', 'Morkfang Madgashas', '10', 'Infused with the power of the Waaagh, the Madgashas charge the Bloody Sun Boyz. Slay the Madgashas before they can erupt and unleash their pent up power.', '778090', null, null, null, null, null, '8161', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('370', '94', 'Stage III', '2', 'Morkfang da Mad', '1', 'Morkfang da Mad believes he is a divine device of the greenskin gods. He challenges the Bloody Sun Boyz! Kill Morkfang da Mad to show his followers their folly.', '778250', null, null, null, null, null, '8162', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('371', '95', 'Stage I', '2', 'Redmane Dwarfs', '40', 'The Dwarfs on this plateau are frantically trying to repair their defenses. Slay the Wardens and Masons to hinder their efforts.', '1705', '5807', null, null, null, null, '8164', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('372', '95', 'Stage II', '2', 'Redmane Skyrangers', '5', 'Gyrocopters have flown in reinforcements to this remote mountain top, stop them before they secure the area!', '7112', null, null, null, null, null, '8165', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('373', '95', 'Stage III', '2', 'Master Engineer Rulf', '1', 'Master Engineer Rulf is intent on keeping this outpost from falling into greenskin hands. Defeat him!', '778227', null, null, null, null, null, '8166', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('374', '96', 'Stage I', '2', 'Oathbearer Dwarfs Killed', '75', 'The Dwarfs seem engaged in some sort of plan that will undoubtedly be bad for the greenskins in this area. Do whatever you can to stop them.', '1974', '1970', '1979', '7230', null, null, '8172', '0', '0', '0', '1', '1');
