INSERT INTO `pquest_objectives` VALUES ('379', '96', 'Stage III', '2', 'Verkner Steelbeard', '1', 'Verkner Steelbeard is none too pleased with the greenskins and their allies for having thwarted his plans. Kill him, and all those who flank him.', '778237', null, null, null, null, null, '8174', '0', '0', '0', '1', '1');
