INSERT INTO `pquest_objectives` VALUES ('381', '97', 'Stage I', '3', 'Bait Set', '20', 'The ground is littered with the corpses of dead Dwarfs. Grab the Dwarf skeletons and put them on the empty stands to use as bait. When the Wyverns come down to feast upon the bones, attack them until you\'ve broken them into service.', '100347', null, null, null, null, null, '8176', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('382', '97', 'Stage I', '2', 'Wyverns', '60', 'The ground is littered with the corpses of dead Dwarfs. Grab the Dwarf skeletons and put them on the empty stands to use as bait. When the Wyverns come down to feast upon the bones, attack them until you\'ve broken them into service.', '5592', null, null, null, null, null, '8176', '0', '0', '0', '1', '1');
