INSERT INTO `pquest_objectives` VALUES ('384', '97', 'Stage III', '2', 'Scarwing', '1', 'Drorkhug Bash\'ard attempts to lay claim to Scarwing the Unclaimable. If he fails, then it falls on the rest of the Bloody Sun Boyz and their allies to do the job in his stead.', '9410', null, null, null, null, null, '8178', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('385', '98', 'Stage I', '2', 'Rebellin\' Orcs & Goblins', '100', 'Skargor has made a play for leadership of the Bloody Sun Boyz. Punish his followers for their disloyalty. Kill them.', '5587', '5594', '5822', '5595', null, null, '8180', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('386', '98', 'Stage II', '2', 'Khrunga da Midboss', '1', 'Khrunga da Midboss is Skargor\'s main go-to guy for resolving disputes - such as this one! He has vowed to fight until the end. Slay the rebellious Shaman.', '778052', null, null, null, null, null, '8181', '0', '0', '0', '1', '1');
