INSERT INTO `pquest_objectives` VALUES ('426', '106', 'Stage II', '0', 'Black Powder', '10', 'These hideous creatures seem to be coming from the cave at the north tip of Venom Lake. That entrance needs to be sealed! Gather black powder barrels from the west wing of the lake, and use them at the cavern opening to stack them there, so that this sickening procession may be brought to an end!', '11001', null, null, null, null, null, '9005', '0', '0', '0', '1', '1');
