INSERT INTO `pquest_objectives` VALUES ('428', '107', 'Stage I', '2', 'Excavating Greenskins', '25', 'The invading Dark Elves have enlisted the help of the area\'s greenskins to locate the key to the magical energy in these High Elf ruins.  Such power in the hands of the Dark Elves would be devastating.  Stop this excavation, at all costs.  ', '6693', null, null, null, null, null, '8956', '0', '0', '0', '1', '1');
