INSERT INTO `pquest_objectives` VALUES ('443', '109', 'Stage III', '2', 'Uthorin Witches', '3', 'This whole camp seems to have been little more than a trap, to lure the Oathbearers in for a quick kill.  And Morthek Silentblade, a master of shadows that has rarely been cornered, is the one who intends to carry out this plan.  See to it that his attempt ends in failure.', '0', null, null, null, null, null, '8962', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('444', '109', 'Stage III', '2', 'Morthek Silentblade', '1', 'This whole camp seems to have been little more than a trap, to lure the Oathbearers in for a quick kill.  And Morthek Silentblade, a master of shadows that has rarely been cornered, is the one who intends to carry out this plan.  See to it that his attempt ends in failure.', '1000777', null, null, null, null, null, '8962', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('445', '109', 'Stage III', '2', 'Deathdealer', '1', 'This whole camp seems to have been little more than a trap, to lure the Oathbearers in for a quick kill.  And Morthek Silentblade, a master of shadows that has rarely been cornered, is the one who intends to carry out this plan.  See to it that his attempt ends in failure.', '1000776', null, null, null, null, null, '8962', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('446', '110', 'Stage I', '2', 'Kill Bloody Sun Laborers', '50', 'Tools can be seen glinting among the rocks between the laborers.  Kill the Laborers and recover the Dwarf Tool Boxes.', '40842', null, null, null, null, null, '9012', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('447', '110', 'Stage I', '3', 'Collect Dwarf Tool Boxes', '25', 'Tools can be seen glinting among the rocks between the laborers.  Kill the Laborers and recover the Dwarf Tool Boxes.', '99171', null, null, null, null, null, '9012', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('448', '110', 'Stage II', '2', 'Greenskin Effigy Progress', '5', 'The Bloody Sun Carvas make their way towards the greenskin Effigy.  Stop them before they finish it!', '1000823', null, null, null, null, null, '9013', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('449', '110', 'Stage III', '2', 'Kill Grimgork', '1', 'Grimgork draws power from the effigy.  He must be killed to end this madness.', '1000824', null, null, null, null, null, '9014', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('450', '111', 'Stage I', '2', 'Kill Cultists of the Schemer', '25', 'The Cultists are chanting in an attempt to summon foul daemons.  Kill the Cultists of the Schemer and prevent this dark ritual.', '40829', null, null, null, null, null, '9016', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('451', '111', 'Stage II', '2', 'Twisted Furies', '25', 'The Furies burst forth into the world.  Kill the Furies to close the portals.  ', '40825', null, null, null, null, null, '9017', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('452', '111', 'Stage III', '2', 'Magister Dhetal', '1', 'Magister Dhetal hovers on his Disc-like abomination, throwing magical fire at the intruders.  Kill Dhetal and silence his evil works forever.  ', '40824', null, null, null, null, null, '9018', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('453', '112', 'Stage I', '2', 'Gross Gits', '50', 'The greenskins bathe in their own filth, seeming to relish in the disgusting smell.  Kill the Gross Gits and Smelly Gits and put an end to the vile display.', '6418', null, null, null, null, null, '9020', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('454', '112', 'Stage I', '2', 'Smelly Gits', '50', 'The greenskins bathe in their own filth, seeming to relish in the disgusting smell.  Kill the Gross Gits and Smelly Gits and put an end to the vile display.', '0', null, null, null, null, null, '9020', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('455', '112', 'Stage II', '3', 'Piles of Filth Destroyed', '10', 'The Piles of Filth seem to move and writhe.  Destroy the piles to prevent anything alive inside from emerging.', '99234', null, null, null, null, null, '9021', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('456', '112', 'Stage III', '2', 'Da Stink', '1', 'The orc simply known as Da Stink wanders the area.  It would seem the foulness of this place has affected him in some way...  ', '1000825', null, null, null, null, null, '9022', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('457', '113', 'Stage I', '2', 'Ungrim\'s Finest', '50', 'Duraz Dok guards the approach to Slayer Keep. Fight your way into the keep and past the force of Ungrim\'s Finest that stand between the Bloody Sun Boyz and the Dwarf artillery. Kill the Dwarfs and silence their cannons!', '6135', null, null, null, null, null, '8240', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('458', '113', 'Stage I', '11', 'Cannon Destroyed', '6', 'Duraz Dok guards the approach to Slayer Keep. Fight your way into the keep and past the force of Ungrim\'s Finest that stand between the Bloody Sun Boyz and the Dwarf artillery. Kill the Dwarfs and silence their cannons!', '119', null, null, null, null, null, '8240', '0', '1', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('459', '113', 'Stage II', '2', 'Kill Captain Stonefist', '1', 'With the gates smashed and the cannons destroyed, only Captain Stonefist in his tower prevents the greenskins from driving out the Dwarfs completely. Kill him!!', '42642', null, null, null, null, null, '8241', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('460', '113', 'Stage III', '0', 'Keep Glutnog and Gutz Alive', '1', 'Greenskins swarm into Duraz Dok led by Glutnog and Gutz.  Not even realizing the Dwarf keep would give them a strategic advantage, they\'re just interested in killing every Dwarf in sight. Keep them alive as they face the Dwarf reinforcements, no matter how many may come!', '0', null, null, null, null, null, '8242', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('461', '113', 'Stage IV', '2', 'Kill Skor Douraxe', '1', 'Slayer Keep has sent one of their finest, defeat the Demon Slayer Skor Douraxe!', '56286', null, null, null, null, null, '8243', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('462', '115', 'Stage I', '11', 'Smash Barrels', '25', 'The Slayer Tavern has seen its share of violence from its patrons and weathered many bar-wide brawls, but never from a Greenskin Waaagh of this size. Destroy the barrels and slay the Dwarfs to bring this party to an end.', '100378', null, null, null, null, null, '8244', '0', '1', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('463', '115', 'Stage I', '2', 'Bash Dwarfs', '25', 'The Slayer Tavern has seen its share of violence from its patrons and weathered many bar-wide brawls, but never from a Greenskin Waaagh of this size. Destroy the barrels and slay the Dwarfs to bring this party to an end.', '7651', null, null, null, null, null, '8244', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('464', '115', 'Stage II', '2', 'Tavern Beermaiden', '6', 'Ruining their beer stores has gotten the Dwarfs\' attention alright. Except instead of crushing the dwarf spirit it has brought out the one thing which might put a Dwarf in line, Beermaidens. Crush these babes of the brew to halt the flow of their precious liquor.', '46188', null, null, null, null, null, '8245', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('465', '115', 'Stage III', '2', 'Defeat Slayer Waves', '4', 'Word has reached the Slayer Keep of the fight at the tavern. Slaughter the Slayers to prevent them from wiping out the greenskin Waaagh!', '46180', null, null, null, null, null, '8246', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('466', '116', 'Stage I', '2', 'Karak Kadrin Defenders', '100', 'The Dwarfs of Kadrin Valley have amassed to take their final stand with the Slayers at their last point of defense, Karak Kadrin. Destroy their forces.', '6132', '2000511', '6122', '6137', null, null, '8252', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('467', '116', 'Stage II', '2', 'Siege Crew Lost', '10', 'The siege must be maintained in order to break down the doors of Karak Kadrin. Ensure the crews stay alive.', '6145', null, null, null, null, null, '8253', '240', '1', '190', '0', '1');
INSERT INTO `pquest_objectives` VALUES ('468', '116', 'Stage III', '2', 'Karak Kadrin Slayers', '18', 'The Karak Kadrin Slayers must be destroyed. Defeat their most powerful warriors, including the Slayer King\'s own son, Garagrim Ironfist. Only then can the Bloody Sun Boyz hope to take on their king and win.  ', '15542', '15540', '15543', '15539', null, null, '8254', '0', '1', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('469', '116', 'Stage III', '2', 'Drugen Axeblood', '1', 'The Karak Kadrin Slayers must be destroyed. Defeat their most powerful warriors, including the Slayer King\'s own son, Garagrim Ironfist. Only then can the Bloody Sun Boyz hope to take on their king and win.  ', '15541', null, null, null, null, null, '8254', '0', '1', '876', '0', '1');
INSERT INTO `pquest_objectives` VALUES ('470', '116', 'Stage III', '2', 'Halgan Beardsplitter', '1', 'The Karak Kadrin Slayers must be destroyed. Defeat their most powerful warriors, including the Slayer King\'s own son, Garagrim Ironfist. Only then can the Bloody Sun Boyz hope to take on their king and win.  ', '44772', null, null, null, null, null, '8254', '0', '1', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('471', '116', 'Stage III', '2', 'Garagrim Ironfist', '1', 'The Karak Kadrin Slayers must be destroyed. Defeat their most powerful warriors, including the Slayer King\'s own son, Garagrim Ironfist. Only then can the Bloody Sun Boyz hope to take on their king and win.  ', '44769', null, null, null, null, null, '8254', '0', '1', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('472', '116', 'Stage IV', '2', 'Ungrim Ironfist', '1', 'At last, nothing  stands between the Bloody Sun Waaagh! and Ungrim Ironfist. Destroy the Slayer King, and bring the Dwarf kingdom to its knees.', '44767', '', '', null, null, null, '8255', '0', '1', '880', '0', '1');
INSERT INTO `pquest_objectives` VALUES ('473', '119', 'Stage I', '2', 'Battlegut Bulls', '25', 'The Battlegut tribe of ogres was not satisfied with the teeth that the Waaagh! attempted to pay them in, and has turned against the greenskins. Show them what happens to those who oppose a Waaagh!', '6100', null, null, null, null, null, '8232', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('474', '119', 'Stage I', '2', 'Battlegut Gnoblars', '25', 'The Battlegut tribe of ogres was not satisfied with the teeth that the Waaagh! attempted to pay them in, and has turned against the greenskins. Show them what happens to those who oppose a Waaagh!', '15930', null, null, null, null, null, '8232', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('475', '119', 'Stage II', '2', 'Mountain Yhetees', '6', 'Answering the ancestral call, Yhetees have descended from their mountain homes. Beware their freezing aura!', '46569', null, null, null, null, null, '8233', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('476', '119', 'Stage III', '2', 'Mogg Battlegut', '1', 'The Ogre Hunter Mogg Battlegut has returned from his solitary hunt to find his tribe in ruins.', '46570', null, null, null, null, null, '8235', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('477', '119', 'Stage III', '2', 'Tamed Sabertusks', '2', 'The Ogre Hunter Mogg Battlegut has returned from his solitary hunt to find his tribe in ruins.', '0', null, null, null, null, null, '8235', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('478', '120', 'Stage I', '2', 'Clarion Archers', '20', 'High Elves have established a base in Kadrin Valley to help their Dwarf allies. Take out their forces and clear a path to the tower!', '15350', null, null, null, null, null, '8236', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('479', '120', 'Stage I', '2', 'Clarion Blades', '20', 'High Elves have established a base in Kadrin Valley to help their Dwarf allies. Take out their forces and clear a path to the tower!', '7361', null, null, null, null, null, '8236', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('480', '120', 'Stage II', '2', 'Brightblades and Lightsingers', '10', 'With the outer defenses dead, the way to the tower is clear. However the fight is hardly won, as the Elves have fallen back to their dreaded Eagleclaw Bolt Throwers.', '99685', '99684', null, null, null, null, '8237', '0', '1', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('481', '120', 'Stage II', '11', 'Destroy Eagle Claws', '5', 'With the outer defenses dead, the way to the tower is clear. However the fight is hardly won, as the Elves have fallen back to their dreaded Eagleclaw Bolt Throwers.', '2000559', null, null, null, null, null, '8237', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('482', '120', 'Stage III', '2', 'Kill Tarril Bladedancer', '1', 'The commander of the High Elf forces in Kadrin Valley awaits the invaders inside the tower. Defeat this Swordmaster of Hoeth!', '99687', null, null, null, null, null, '8238', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('483', '121', 'Stage I', '2', 'Road Wardens', '80', 'The Empire Caravans traveling through Kadrin Valley use the area outside the keep walls as a staging ground. Slaughter the Travelers and Patrons, and the Wardens who\'ve sworn to guard them!', '7647', null, null, null, null, null, '8248', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('484', '121', 'Stage I', '2', 'Travelers and Patrons', '95', 'The Empire Caravans traveling through Kadrin Valley use the area outside the keep walls as a staging ground. Slaughter the Travelers and Patrons, and the Wardens who\'ve sworn to guard them!', '7646', '7648', null, null, null, null, '8248', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('485', '121', 'Stage II', '2', 'Oath Scribes', '5', 'Duraz Deb\'s first line of defense is gone! Storm the walls and kill the Oath Scribes before the Drengi Initiates can take slayer oath!  ', '46185', null, null, null, null, null, '8249', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('486', '121', 'Stage II', '2', 'Oath\'s Taken', '25', 'Duraz Deb\'s first line of defense is gone! Storm the walls and kill the Oath Scribes before the Drengi Initiates can take slayer oath!  ', '44171', null, null, null, null, null, '8249', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('487', '121', 'Stage III', '2', 'Kill Mournbrow', '1', 'Though the Dwarfs realize they\'re doomed, their stubbornness is fueled by their leader Mournbrow. Remove him, and their strength will crumble leaving Duraz Deb defensless!', '46181', null, null, null, null, null, '8250', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('488', '122', 'Stage I', '11', 'Use Explosives to Destroy Dragon Bones', '15', 'Drakk Cultists are using ancient Dragon Bones to peform a dark ritual. They must be stopped!\nPick up an Explosive Barrel, then interact with a Dragon Bone to place the barrel and light its fuse.', '99123', null, null, null, null, null, '8964', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('489', '122', 'Stage II', '2', 'Kill Drakk Fire-Channelers', '10', 'Drakk Fire-Channelers are highly unstable, and tend to explode when they lose control of their magic. Kill the Drakk Fire-Channelers and Drakk Acolytes.\nMake sure to keep your distance when a Drakk Fire-Channeler dies near you.', '38126', null, null, null, null, null, '8965', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('490', '122', 'Stage II', '2', 'Kill Drakk Acolytes', '20', 'Drakk Fire-Channelers are highly unstable, and tend to explode when they lose control of their magic. Kill the Drakk Fire-Channelers and Drakk Acolytes.\nMake sure to keep your distance when a Drakk Fire-Channeler dies near you.', '0', null, null, null, null, null, '8965', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('491', '122', 'Stage III', '2', 'Dragonblessed Qilarn', '1', 'Dragonblessed Qilarn must be slain or the Dwarf forces will be routed. He is accompanied by Drakk Fire-Channelers, whose instability may prove useful during your fight against Qilarn.', '1000340', null, null, null, null, null, '8966', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('492', '123', 'Stage I', '2', 'Reichert\'s Treasure Diggers', '30', 'Reichert\'s Raiders and the Red Bashas seem to be fighting over the Dwarf caches.  The Oathbearers will need to defeat both of these factions to claim their ancestral treasures.', '8785', null, null, null, null, null, '8968', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('493', '123', 'Stage I', '2', 'Red Bashas', '30', 'Reichert\'s Raiders and the Red Bashas seem to be fighting over the Dwarf caches.  The Oathbearers will need to defeat both of these factions to claim their ancestral treasures.', '8782', null, null, null, null, null, '8968', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('494', '123', 'Stage II', '2', 'Banners Planted', '5', 'The greenskins are trying to lay claim by planting their banners. Kill the greenskins and prevent these banners from being placed.', '1000779', null, null, null, null, null, '8969', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('495', '123', 'Stage III', '2', 'Grimgut da Red Basha', '1', 'The greenskins rally around their champion, Grimgut, who seems to be gaining strength from the Waaagh! magic of his Shaman lackeys.  Fell this Orc.  If he becomes too powerful, try to ascertain the source of the Shamans\' energy, and eliminate it.', '1000781', null, null, null, null, null, '8970', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('496', '124', 'Stage I', '2', 'Thieving Moonfang', '100', 'The Snotlings swarm the area looking for food.  They must be killed in order to enter the camp.', '7583', null, null, null, null, null, '8972', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('497', '124', 'Stage II', '3', 'Kill the Bloody Sun Wolfriders', '25', 'Bloody Sun Wolfriders whip their mounts into an attacking frenzy. Slay them before they overwhelm the Dwarf forces!', '99233', null, null, null, null, null, '8973', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('498', '124', 'Stage III', '2', 'Kill Starving Orcs', '30', 'Driven by hunger, the Bloody Sun Boyz become crazed.  They must be destroyed quickly while they are in a weakened state.', '38973', null, null, null, null, null, '8974', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('499', '124', 'Stage IV', '2', 'Crushfist the Hollow', '1', 'Crushfist charges the Dwarfs saliva dripping from his maw.  Slay the massive Orc to end the battle.  ', '41735', null, null, null, null, null, '8975', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('500', '126', 'Stage I', '2', 'Clear Canyon Creatures', '175', 'Many dangerous beast now dwell in the ancient canyon ruins.  The beasts need to be slain in order for the Dwarfs to progress further into their ancient homeland.', '6333', null, null, null, null, null, '9032', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('501', '126', 'Stage II', '2', 'Poisonwing Cliff-lords', '6', 'The Cliff-lords descend on the Canyon intent on killing any who threaten the hatchlings.  Drive them off!', '48751', null, null, null, null, null, '9033', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('502', '126', 'Stage III', '2', 'Diemonus', '1', 'The wyvern matriarch Diemonus has finally come down to feast on the attackers. Slay her before the eggs hatch and unleash a wave of hungry mouths.', '48749', null, null, null, null, null, '9034', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('503', '127', 'Stage I', '2', 'Bloody Sun Greenskins', '175', 'The siege of Grudgemaker\'s fortress has begun! First, clear the southern area of greenskins so the Dwarf siege crews can safely load the cannons.  ', '1709', '15848', null, null, null, null, '9028', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('504', '127', 'Stage II', '2', '1st Cannon Progress', '100', 'In order to have a chance at crossing the bridge the decrepit cannons must be restored. Protect the Siege Crews while they do their duty!', '15849', null, null, null, null, null, '9029', '300', '1', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('505', '127', 'Stage II', '2', '2nd Cannon Progress', '100', 'In order to have a chance at crossing the bridge the decrepit cannons must be restored. Protect the Siege Crews while they do their duty!', '42752', null, null, null, null, null, '9029', '300', '1', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('506', '127', 'Stage II', '2', '3rd Cannon Progress', '100', 'In order to have a chance at crossing the bridge the decrepit cannons must be restored. Protect the Siege Crews while they do their duty!', '15848', null, null, null, null, null, '9029', '0', '1', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('507', '127', 'Stage II', '0', 'Siege Crew Lost', '9', 'In order to have a chance at crossing the bridge the decrepit cannons must be restored. Protect the Siege Crews while they do their duty!', '0', null, null, null, null, null, '9029', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('508', '127', 'Stage III', '2', 'Grudges Settled', '500', 'Atop their high hill, the guards of Brugash \'The Grudgemaker\' await the onrushing Oathbearer forces.  ', '2000500', null, null, null, null, null, '9030', '300', '1', '27', '0', '1');
INSERT INTO `pquest_objectives` VALUES ('509', '127', 'Stage IV', '2', 'Brugash \'The Grudgemaker\'', '1', '\"The Grudgemaker\" awaits you in front of his hut. Slay the Greenskin Scum once and for all!', '91565', null, null, null, null, null, '9030', '0', '1', '172', '0', '1');
INSERT INTO `pquest_objectives` VALUES ('510', '128', 'Stage I', '2', 'Kill Reichert\'s Men', '100', 'The Red Raiders set about excavating the ruins. Slay the Excavators and Raiders. Burn their tents before raising our flag to claim the area.', '6790', '6789', null, null, null, null, '8188', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('511', '128', 'Stage I', '11', 'Burn  Reichert\'s Tents', '2', 'The Red Raiders set about excavating the ruins. Slay the Excavators and Raiders. Burn their tents before raising our flag to claim the area.', '98758', null, null, null, null, null, '8188', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('512', '128', 'Stage I', '3', 'Place  Greenskin Banner', '1', 'The Red Raiders set about excavating the ruins. Slay the Excavators and Raiders. Burn their tents before raising our flag to claim the area.', '118', null, null, null, null, null, '8188', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('513', '128', 'Stage II', '3', 'Shinies on the Greenskin Pile', '40', 'The opportunistic Red Raiders return to lay claim to the treasure. Grab the Shinies and add them to your pile before the Red Raiders can claim them all.', '98765', null, null, null, null, null, '8189', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('514', '128', 'Stage II', '3', 'Shinies in Reichert\'s Vault', '40', 'The opportunistic Red Raiders return to lay claim to the treasure. Grab the Shinies and add them to your pile before the Red Raiders can claim them all.', '0', null, null, null, null, null, '8189', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('515', '128', 'Stage III', '2', 'Kill Franz Reichert', '1', 'Franz Reichert has come to stake his claim. Slay Franz Reichert and his Hands.', '43889', null, null, null, null, null, '8190', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('516', '128', 'Stage III', '2', 'Kill Reichert\'s Hand', '2', 'Franz Reichert has come to stake his claim. Slay Franz Reichert and his Hands.', '43893', null, null, null, null, null, '8190', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('517', '129', 'Stage I', '2', 'Runki Gateguard', '25', 'The Runki Dwarfs form a phalanx to defend against the greenskins. Kill the Runki Gateguards outside of the keep, and use the Rock Lobbers to destroy the Runki Warriors inside.', '6249', null, null, null, null, null, '8192', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('518', '129', 'Stage I', '2', 'Runki Warrior', '75', 'The Runki Dwarfs form a phalanx to defend against the greenskins. Kill the Runki Gateguards outside of the keep, and use the Rock Lobbers to destroy the Runki Warriors inside.', '14246', null, null, null, null, null, '8192', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('519', '129', 'Stage II', '2', 'Runki Ironbreakers', '10', 'The elite Ironbreakers and Hammerers charge into the greenskin ranks. Slay them to break their defense.', '15087', null, null, null, null, null, '8193', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('520', '129', 'Stage II', '2', 'Runki Hammerers', '8', 'The elite Ironbreakers and Hammerers charge into the greenskin ranks. Slay them to break their defense.', '15086', null, null, null, null, null, '8193', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('521', '129', 'Stage III', '2', 'Runemaster Nimli', '1', 'Nimli Rockhand and his retinue are all that stands in the way of a greenskin victory at Und-A-Runki. Slay the Runemaster and his guards.', '43894', null, null, null, null, null, '8194', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('522', '129', 'Stage III', '2', 'Forge Guard', '2', 'Nimli Rockhand and his retinue are all that stands in the way of a greenskin victory at Und-A-Runki. Slay the Runemaster and his guards.', '43892', null, null, null, null, null, '8194', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('523', '130', 'Stage I', '2', 'Kill Filthy Creatures', '50', 'The aura and power of the Anvil has been corrupted.  This is a feat that was thought nigh impossible.  Kill the filthy beasts spawned from the defiled Anvil.', '6273', null, null, null, null, null, '9024', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('524', '130', 'Stage II', '11', 'Corrupting Stones Destroyed', '5', 'The stones seem to be the source of the corrupting power used to subvert the Anvil.  Destroy the corrupting stones and free the Anvil.', '99191', null, null, null, null, null, '9025', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('525', '130', 'Stage III', '2', 'Kill Plagueborn Beast', '1', 'Vile magics have robbed the Dwarfs of their ancient Anvil.  Destroy the Plagueborn Beast to avenge those that lost their lives searching for the ancient.', '1000821', null, null, null, null, null, '9026', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('526', '131', 'Stage I', '2', 'Gutbash Gnobleaters Bashed', '20', 'Mistaking the Gnoblars for Goblins, Boss Slagrot has ordered the Bloody Sun Boyz to remind these \'defective\' Gobbos how tough greenskins are by killing the Ogres. Doing this will surely turn their loyalty back to the Waaagh!', '6644', null, null, null, null, null, '8184', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('527', '131', 'Stage II', '2', 'Groincrunchers Slain', '30', 'Now that the Gnoblars are free of the Ogres, their confidence grows, and they initiate attacks against the greenskins. With that, the Bloody Sun Boyz finally realize that these are not Goblins at all, but wicked Gnoblars who need to be smashed. Kill them all, before they overrun the camp!', '6639', null, null, null, null, null, '8185', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('528', '131', 'Stage III', '2', 'Tuff Gutbash', '1', 'Tuff Gutbash has returned to find his camp in shambles, with Gnoblars running amok and greenskins trampling everything in sight. He roars, ready to smash skulls.', '6645', null, null, null, null, null, '8186', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('529', '131', 'Stage III', '2', 'Fullg Mawclubber', '1', 'Tuff Gutbash has returned to find his camp in shambles, with Gnoblars running amok and greenskins trampling everything in sight. He roars, ready to smash skulls.', '6637', null, null, null, null, null, '8186', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('530', '132', 'Stage I', '2', 'Bloody Sun Greenskins', '150', 'The Bloody Suns have gathered here in a show of strength to convince the remaining savage Orcs to join their Waaagh! This is the perfect opportunity to disrupt their efforts. Kill them!', '1086', '1080', null, null, null, null, '8932', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('531', '132', 'Stage II', '3', 'SetTowers on Fire', '5', 'The Oathbearers have made their way into the heart of the Bloody Sun Boyz camp and attracted the attention of the largest Orcs!  Kill them and burn their towers to prove your dominance.', '200264', null, null, null, null, null, '8933', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('532', '132', 'Stage II', '2', 'Bloody Sun Big Krunchas', '10', 'The Oathbearers have made their way into the heart of the Bloody Sun Boyz camp and attracted the attention of the largest Orcs!  Kill them and burn their towers to prove your dominance.', '1000674', null, null, null, null, null, '8933', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('533', '132', 'Stage III', '2', 'Garbog da Splitta', '1', 'The greenskin bosses have returned to their camp. The defeat of their boyz has made them look weak to the Savage Orcs, and then intend on personally proving the strength of the Bloody Suns. Kill them and their filthy beasts', '1000681', null, null, null, null, null, '8934', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('534', '132', 'Stage III', '2', 'Dirtfur', '1', 'The greenskin bosses have returned to their camp. The defeat of their boyz has made them look weak to the Savage Orcs, and then intend on personally proving the strength of the Bloody Suns. Kill them and their filthy beasts', '1000682', null, null, null, null, null, '8934', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('535', '132', 'Stage III', '2', 'Scraggletoof', '1', 'The greenskin bosses have returned to their camp. The defeat of their boyz has made them look weak to the Savage Orcs, and then intend on personally proving the strength of the Bloody Suns. Kill them and their filthy beasts', '1000683', null, null, null, null, null, '8934', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('536', '133', 'Stage I', '2', 'Savage Bloodsnouts', '75', 'The Savage Orcs of the badlands wrangle boars as mounts for the Waaagh!  Defeat the Orcs and slay the boars they are attempting to wrangle.', '17060', null, null, null, null, null, '8936', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('537', '133', 'Stage I', '2', 'Blue Faced Grabbas', '50', 'The Savage Orcs of the badlands wrangle boars as mounts for the Waaagh!  Defeat the Orcs and slay the boars they are attempting to wrangle.', '35110', null, null, null, null, null, '8936', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('538', '133', 'Stage II', '2', 'Blue Face Reapas', '20', 'Oathbearers have earned their ground, but they are assaulted from the flank by boar riding savages.  Slay the Blue Face Reapas and rescue the Dwarf flank!', '1000742', null, null, null, null, null, '8937', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('539', '133', 'Stage III', '2', 'Skullsmasher da Bloodied', '1', 'Skullsmasha da Bloodied circles overhead on his wyvern Pigmuncha.  He is eager to tear the Dwarfs apart.  If the Oathbearers manage to kill him, the remaining Savage Orcs will be driven from the area.', '1000743', null, null, null, null, null, '8938', '0', '0', '0', '1', '1');
