INSERT INTO `pquest_objectives` VALUES ('541', '134', 'Stage I', '0', 'Free Oathbearer Captives', '10', 'Goblins have convinced the Black Orcs to put the captive Dwarfs to work mining ore for the greenskins\' crude weaponry.  The Oathbearers must free their captive brethren and avenge them!', '0', null, null, null, null, null, '8928', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('542', '134', 'Stage I', '2', 'Bloody Sun Orcs', '25', 'Goblins have convinced the Black Orcs to put the captive Dwarfs to work mining ore for the greenskins\' crude weaponry.  The Oathbearers must free their captive brethren and avenge them!', '1000757', null, null, null, null, null, '8928', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('543', '134', 'Stage II', '2', 'Bloody Sun Enforca', '2', 'Unhappy with their larger cousins\' performance, the Bloody Sun Goblins have come to re-establish control over the mine. Defeat them and their vicious Squigs!', '1000678', null, null, null, null, null, '8929', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('544', '134', 'Stage II', '2', 'Enforca\'s Squigs', '8', 'Unhappy with their larger cousins\' performance, the Bloody Sun Goblins have come to re-establish control over the mine. Defeat them and their vicious Squigs!', '0', null, null, null, null, null, '8929', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('545', '134', 'Stage III', '2', 'Bashtoof One-Eye', '1', 'The former Dwarf captives have no greater grudge than the one against Bashtoof One Eye.  He must be slain.', '1000679', null, null, null, null, null, '8930', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('546', '136', 'Stage I', '2', 'Blisterclaw Clanrat', '30', 'The source of Clan Blisterclaw. The Skaven marauders who have ransacked supply lines of the Bloody Sun Boyz have brought the goods here. Slay them all!', '10548', null, null, null, null, null, '8212', '0', '0', '0', '1', '1');
