INSERT INTO `pquest_objectives` VALUES ('549', '136', 'Stage III', '2', 'Warlord Grort Blisterclaw', '1', 'The leader of the Skavens of Death Peak, Warlord Grort Blisterclaw, emerges from his dank keep and vows to wage war against the Bloody Sun Boyz! He cannot be allowed to live to hinder the Waaagh!', '99691', null, null, null, null, null, '8214', '0', '0', '0', '1', '1');
