INSERT INTO `pquest_objectives` VALUES ('551', '137', 'Stage I', '2', 'Valayan Dwarfs Killed', '100', 'Having been slain by Naxael the Soul Feaster, daughter of Azorgaron, the tormented spirits of the Valayan Dwarfs patrol their once great keep of Grom Rodrin. Clear the keep of the spirits to claim its resources for the Waaagh!', '39862', '39858', '39850', '39863', null, null, '8204', '0', '0', '0', '1', '1');
