INSERT INTO `pquest_objectives` VALUES ('556', '137', 'Stage III', '2', 'Ranik Valayason Defeated', '1', 'The spirit of Runelord Ranik Valayason has arrived to defend the keep of Grom Rodrin from the invading Waaagh! He must be defeated to release all inhabitants from the keep, awarding it to the Bloody Sun Boyz!', '42640', null, null, null, null, null, '8206', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('557', '138', 'Stage I', '11', 'Excavation Supplies Destroyed', '20', 'The Oathbearers are excavating the ruins of Mingol Kurdak in hopes of recovering a lost Anvil of Doom. They must be stopped before they can recover it to craft great weapons to use against the Waaagh!', '98954', null, null, null, null, null, '8216', '0', '0', '0', '1', '1');
