INSERT INTO `pquest_objectives` VALUES ('559', '138', 'Stage II', '2', 'Oathbearer Cannoneers Killed', '10', 'The Oathbearers have focused their attacks on the heart of the ruins of Mingol Kurdak against the Waaagh! Kill the Oathbearer Cannoneers and destroy their cannons to prevent them from bolstering their defenses.', '42629', null, null, null, null, null, '8217', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('560', '138', 'Stage II', '11', 'Oathbearer Cannons Destroyed', '5', 'The Oathbearers have focused their attacks on the heart of the ruins of Mingol Kurdak against the Waaagh! Kill the Oathbearer Cannoneers and destroy their cannons to prevent them from bolstering their defenses.', '98960', null, null, null, null, null, '8217', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('561', '138', 'Stage III', '2', 'Excavationer Borgarth Defeated', '1', 'The leader of the Oathbearer excavation operation, Excavationer Borgarth, has emerged from the depths of the mines of Mingol Kurdak. Defeat him and claim the ruins for the Bloody Sun Boyz!  ', '42644', null, null, null, null, null, '8218', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('562', '139', 'Stage I', '2', 'Drakk Cultists Slain', '80', 'The Dwarfs must be freed from the torturous clutches of the Cult of Drakk.  ', '6965', null, null, null, null, null, '8980', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('563', '139', 'Stage I', '2', 'Oathbearers Freed', '30', 'The Dwarfs must be freed from the torturous clutches of the Cult of Drakk.  ', '6963', null, null, null, null, null, '8980', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('564', '139', 'Stage II', '2', 'Drakk Prophets Slain', '8', 'Servants of Azorgaron are being conjured by Drakk Prophets to spill the ichor of imprisoned Dwarfs to restore balance to the ritual. The prophets must be stopped before they succeed!', '778228', null, null, null, null, null, '8981', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('565', '139', 'Stage II', '2', 'Imprisoned Dwarfs Sacrificed', '40', 'Servants of Azorgaron are being conjured by Drakk Prophets to spill the ichor of imprisoned Dwarfs to restore balance to the ritual. The prophets must be stopped before they succeed!', '6965', null, null, null, null, null, '8981', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('566', '139', 'Stage III', '2', 'Drakk Sibyls Slain', '3', 'Drakk Sibyls watchover the slumbering Drakk conjurer to protect her by strenghtening the magical energies protecting her. They must be killed to make Merona vulnerable to attack!', '778071', null, null, null, null, null, '8982', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('567', '139', 'Stage IV', '2', 'Merona the Scaleseeker Slain', '1', 'The Drakk conjurer, Merona the Scaleseeker, has awoken from her slumber after having enough ichor spilled in the name of the Great Drakk! She must be stopped before the ritual conjures forth a broodling of Azorgaron!', '52177', null, null, null, null, null, '8983', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('568', '139', 'Final Stage', '2', 'Merona the Scaleseeker Slain', '1', 'Having been blessed by the power of the Great Drakk, Merona the Scaleseeker has attained unspeakable power and conjured forth Arathien, a broodling of Azorgaron. Her vengeance knows no limits and must be destroyed before she is able to spread the evil of the Drakk cult!', '52177', null, null, null, null, null, '9980', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('569', '139', 'Final Stage', '2', 'Arathien Defeated', '1', 'Having been blessed by the power of the Great Drakk, Merona the Scaleseeker has attained unspeakable power and conjured forth Arathien, a broodling of Azorgaron. Her vengeance knows no limits and must be destroyed before she is able to spread the evil of the Drakk cult!', '1000878', null, null, null, null, null, '9980', '0', '0', '0', '1', '1');
