INSERT INTO `pquest_objectives` VALUES ('1332', '334', 'Stage VI', '2', 'Zekaraz the Bloodcaller', '1', 'Zekaraz reinforces the power of the Khornite Seals with rage and promise of bloodshed.  Defeat the daemon champion!', '46325', null, null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1333', '335', 'Stage I', '2', 'Kill Bloodfueled Devotees', '30', 'The Witch Elves are the perverted followers of the Elven god Khaine.  Whatever it is they seek will only spell doom for the High Elves.  Slay them.', '2411', null, null, null, null, null, '9316', '0', '0', '0', '1', '1');
