INSERT INTO `pquest_objectives` VALUES ('1337', '336', 'Stage I', '2', 'Corsairs', '25', 'Defend against the onslaught for as long as possible while the Sea Guard readies the bolt throwers.  Kill the Orcs and Corsairs.', '2420', null, null, null, null, null, '9320', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1338', '336', 'Stage I', '2', 'Orcs', '75', 'Defend against the onslaught for as long as possible while the Sea Guard readies the bolt throwers.  Kill the Orcs and Corsairs.', '1447', null, null, null, null, null, '9320', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1339', '336', 'Stage II', '2', 'Eagle Claws Destroyed', '3', 'The artillery line must hold!  Defend the Eagle Claws and their crew to ensure they keep firing on the invaders.', '3159', null, null, null, null, null, '9321', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1340', '336', 'Stage III', '2', 'Verekus the Render', '1', 'The leader of this Corsair fleet, Verekus the Render, emerges from below decks ready to face the defenders himself.  The cruel Reaver must be stopped.', '4529', null, null, null, null, null, '9322', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1341', '337', 'Stage I', '2', 'Kill Uthorin Thralltakers', '30', 'The Dark Elves have enslaved the citizens of Yenlui.  They must be freed.  Start by killing off the Thralltakers.', '2842', null, null, null, null, null, '9324', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1342', '337', 'Stage II', '2', 'Captives Freed', '10', 'The Keymasters guard the cages of their captives.  Slay the Keymasters to set your brethren free so that they can be escorted to freedom.', '13578', null, null, null, null, null, '9325', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1343', '337', 'Stage II', '2', 'Captives Killed', '5', 'The Keymasters guard the cages of their captives.  Slay the Keymasters to set your brethren free so that they can be escorted to freedom.', '0', null, null, null, null, null, '9325', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1344', '337', 'Stage III', '0', 'Kill Vrecht the Merciless', '1', 'Vrecht the Merciless is in charge of this wicked trade.  His cruel operation must be brought to an end.  Kill Vrecht and his accomplices to end this horrible trade!', '0', null, null, null, null, null, '9326', '0', '0', '0', '1', '1');
