INSERT INTO `pquest_objectives` VALUES ('1346', '338', 'Stage II', '2', 'Conduits Placed', '6', 'Retrieve Dhar Charms from the Sorceresses.  Then place them, one at a time, on the platforms around the base of the tower.  As they are your only source of Dhar Charms, they must remain alive!', '2068', null, null, null, null, null, '8525', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1347', '338', 'Stage II', '2', 'Sorceresses Killed', '4', 'Retrieve Dhar Charms from the Sorceresses.  Then place them, one at a time, on the platforms around the base of the tower.  As they are your only source of Dhar Charms, they must remain alive!', '0', null, null, null, null, null, '8525', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1348', '338', 'Stage III', '2', 'Archmage Lithorial', '1', 'The unrelenting advance of Dark Elf troops has managed to interrupt the archmage\'s channeled protections. Now is the time to strike him down!', '2069', null, null, null, null, null, '8526', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1349', '339', 'Stage I', '2', 'Spites', '35', 'The Dark Elf invasion has roused the ire of ancient Mistwood. Kill the Venomroot Spites to weaken the spirit of the forest.', '2090', null, null, null, null, null, '8528', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1350', '339', 'Stage II', '2', 'Venombough Dryads', '8', 'The Dryads of Mistwood take on the aspect of war and charge the invaders.  Slaughter the Venombough Dryads to purge them from the forest.', '2092', null, null, null, null, null, '8529', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1351', '339', 'Stage III', '2', 'Branchwraith Ylrisae', '1', 'Branchwraith Ylrisae has awoken to deal with the invading Dark Elves. Defeat her to shatter the spirit of the forest.', '2870', null, null, null, null, null, '8530', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1352', '340', 'Stage I', '2', 'Nimosar Defenders', '100', 'The order has been given and the Dark Elves advance on Nimosar.  Slay the Guardians and Warriors that protect the town.', '2194', null, null, null, null, null, '8532', '0', '0', '0', '1', '1');
