INSERT INTO `pquest_objectives` VALUES ('1357', '341', 'Stage 1', '0', 'Goldenwing Eagles', '20', 'Golden Tor is littered with the nests of eagles that will not be bent to Dark Elf servitude. Slaughter the beasts and deny the High Elves both mounts and allies.', '5430', null, null, null, null, null, '8540', '0', '0', '0', '1', '1');
