INSERT INTO `pquest_objectives` VALUES ('1360', '342', 'Stage I', '2', 'Gon\'Seraph Citizens Captured', '15', 'More servants are needed for the Dark Elf Work Pits.  Seek out the citizens of Gon\'Seraph and drive them to the Servant Carts.', '2484', null, null, null, null, null, '8544', '0', '0', '0', '1', '1');
