INSERT INTO `pquest_objectives` VALUES ('1372', '345', 'Stage I', '2', 'Kill Uthorin Forces', '100', 'Something sinister lurks in the forest.  Kill the Shades of the Dark Elves that are responsible for the burning of Thanalorn Forest.', '2360', '1000727', null, null, null, null, '9304', '0', '0', '0', '1', '1');
