INSERT INTO `pquest_objectives` VALUES ('1374', '345', 'Stage III', '2', 'Kill Felgrith the Arsonist', '1', 'Felgrith\'s mastery of fire is a terrible sight to behold.  Slay him before all of Thanalorn is nothing but a charred memory.', '1000730', null, null, null, null, null, '9306', '0', '0', '0', '1', '1');
