INSERT INTO `pquest_objectives` VALUES ('1379', '346', 'Stage III', '2', 'Beast Lord Revarok', '1', 'Beast Lord Revarok leads a collection of terrifying creatures through the swale.  He must be stopped.  ', '2377', null, null, null, null, null, '9310', '0', '0', '0', '1', '1');
