INSERT INTO `pquest_objectives` VALUES ('1389', '359', 'Stage I', '2', 'Hunter Axebearers', '40', 'The Dark Elves descend upon Tor Achare like wolves to the slaughter.  Kill the Guards and Magi.', '4840', null, null, null, null, null, '8556', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1390', '359', 'Stage II', '2', 'Eagle Claws destroyed', '10', 'The Hunt Masters try and put up some form of defense against the Dark Elf invasion.  Destroy the Hunters operating the Eagle Claw Bolt Throwers to allow access to the city.', '2519', null, null, null, null, null, '8557', '0', '0', '0', '1', '1');
