INSERT INTO `pquest_objectives` VALUES ('1858', '458', 'Stage II', '2', 'Theksys slain', '1', 'The massive gates of the fortress are not immune to the mighty hydra! Destroy the bolt throwers and the charging Dragon Princes that seek to slay the beast!', '1526', null, null, null, null, null, '8693', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1859', '458', 'Stage III', '2', 'Fortress Dragons and Dragontamers Slain', '4', 'Slay Imrik\'s retinue so that the pathetic prince will join the fight instead of battling from afar!', '45701', null, null, null, null, null, '8694', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1860', '458', 'Stage IV', '2', 'Imrik and Minaithnir slain', '1', 'Slay Prince Imrik and Minaithnir, thereby ending the line of the Phoenix King Caledor forever!', '45700', null, null, null, null, null, '8695', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1861', '459', 'Stage I', '2', 'Slay Galiron\'s Mouth High Elves', '100', 'The dragon is still yet asleep. When he awakens, he will be a powerful tool for the Dark Elves, should he be broken. Slay all the High Elves excavating the cave, as well as those guarding it.', '5939', null, null, null, null, null, '8728', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1862', '459', 'Stage II', '3', 'Charges Detonated', '10', 'The servants of the Dark Elves have been brought forth to handle the dirty business of excavating the cave. Ensure that they are properly motivated.', '100608', null, null, null, null, null, '8729', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1863', '459', 'Stage III', '2', 'Kill Galiron the Eternal', '1', 'Galiron has emerged from his slumber ready to wreak havoc on those that have slain his protectors. Slay the beast or his fury will destroy you.', '48092', null, null, null, null, null, '8730', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1864', '460', 'Stage I', '2', 'Uthorin Drakebreakers', '30', 'The dragon Aenares has been captured by the Dark Elves. Destroy them, and free the great dragon from his bindings before it is too late to save him!', '1776', null, null, null, null, null, '9500', '0', '0', '0', '1', '1');
