INSERT INTO `pquest_objectives` VALUES ('1921', '470', 'Stage II', '2', 'Shadowchasm Veilseeker slain', '8', 'The Veilseekers are the harbingers of a much more terrible power. Defeat them quickly so that you might have time to prepare yourself. Continue to burn the Razormist tents and light the Wayfarer Fonts to keep your enemies at bay.', '43058', null, null, null, null, null, '9533', '0', '0', '0', '1', '1');
