INSERT INTO `pquest_objectives` VALUES ('1933', '473', 'Stage I', '2', 'Uthorin Shockcaller', '35', 'The Shrine of the Slayer is held by the Dark Elves, dishonoring the king\'s memory. Reclaim the honored Shrine of the Slayer from their grasp!', '9934', null, null, null, null, null, '9540', '0', '0', '0', '1', '1');
