INSERT INTO `pquest_objectives` VALUES ('1940', '473', 'Stage IV', '2', 'Lord Merethen Shadowclaw', '1', 'The Dark Elf commander of the counterattack upon the Shrine has arrived, mounted upon a mighty dragon. Destroy him and end this assault once and for all!', '1002011', null, null, null, null, null, '9543', '0', '0', '0', '1', '1');
