INSERT INTO `pquest_objectives` VALUES ('1943', '474', 'Stage I', '3', 'Prison Camp Liberated', '3', 'High Elf prisoners not fortunate enough to die in battle are now tormented by the Dark Elves before being put to the sword. Liberate the enemy camps by bringing down the banners of the Dark Elves!', '99539', null, null, null, null, null, '9544', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1944', '474', 'Stage II', '2', 'Kill Lord Ulkarath', '1', 'The captains of Tullaris\' Host now enter the field of battle. Slay them and end his hold on Caledor.', '1002006', null, null, null, null, null, '9545', '0', '0', '0', '1', '1');
