INSERT INTO `pquest_objectives` VALUES ('1946', '474', 'Stage II', '2', 'Kill Silderok', '1', 'The captains of Tullaris\' Host now enter the field of battle. Slay them and end his hold on Caledor.', '1002008', null, null, null, null, null, '9545', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1947', '474', 'Stage III', '2', 'Tullaris', '1', 'So feared is he that the mention of Tullaris\' name is forbidden in some parts of Ulthuan. If the High Elves are to know victory this day, Tullaris must be faced and defeated atop the ancient plateaus of Caledor.', '778059', null, null, null, null, null, '9546', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1948', '474', 'Stage III', '2', 'Helglaive Bloodshades', '2', 'So feared is he that the mention of Tullaris\' name is forbidden in some parts of Ulthuan. If the High Elves are to know victory this day, Tullaris must be faced and defeated atop the ancient plateaus of Caledor.', '9941', null, null, null, null, null, '9546', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1949', '475', 'Stage I', '2', 'Glory', '100', 'The House of Dawnbreak is far too arrogant. Destroy the camp\'s defenders and capture strategic locations to teach the High Elves proper humility. The glory of their defeat is ours to claim!', '6892', null, null, null, null, null, '8760', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1950', '475', 'Stage II', '2', 'Glory', '150', 'Hold the locations of the Manor estate in order to shatter the Dawnbreak defense.', '43631', null, null, null, null, null, '8761', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1951', '475', 'Stage III', '2', 'Lord Kaelik Dawnbreak', '1', 'Kill Lord Kaelik Dawnbreak to conquer the manor. Maintain your control of the manor estate to gain the support of your allies in this final battle.', '44566', null, null, null, null, null, '8762', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1952', '476', 'Stage I', '2', 'Central Plaza', '1', 'The defenders of Shimmersward believe themselves equal to the might of the Uthorin army. How wrong they are. Kill their leader, Laerion Bravebrow, and secure the plaza.', '6904', null, null, null, null, null, '8756', '0', '1', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1953', '476', 'Stage II', '2', 'Eastern Quarter Secured', '1', 'The town must be secured by any means necessary. Slaughter the High Elf leaders and their guardians! There will be time enough to rebuild once Ulthuan is ours!', '43411', null, null, null, null, null, '8757', '0', '1', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1954', '476', 'Stage II', '2', 'Southern Quarter Secured', '1', 'The town must be secured by any means necessary. Slaughter the High Elf leaders and their guardians! There will be time enough to rebuild once Ulthuan is ours!', '47521', null, null, null, null, null, '8757', '0', '1', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1955', '476', 'Stage II', '2', 'Western Quarter Secured', '1', 'The town must be secured by any means necessary. Slaughter the High Elf leaders and their guardians! There will be time enough to rebuild once Ulthuan is ours!', '6905', null, null, null, null, null, '8757', '0', '1', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1956', '476', 'Stage II', '0', 'Central Plaza Lost', '1', 'The town must be secured by any means necessary. Slaughter the High Elf leaders and their guardians! There will be time enough to rebuild once Ulthuan is ours!', '0', null, null, null, null, null, '8757', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1957', '476', 'Stage III', '2', 'Eltharion the Grim', '1', 'What a waste! Lothern has sent a blind warrior into battle. Malekith himself allowed Eltharion to live once before. For his defiance today, the warriors of House Uthorin shall claim his life!', '47522', null, null, null, null, null, '8758', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1958', '477', 'Stage I', '2', 'Guardians of Eataine', '30', 'The defenders of Eataine have rallied here to acquire their greatest armaments and pay homage to their ancestors. Destroy them!', '6889', null, null, null, null, null, '8764', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1959', '477', 'Stage II', '3', 'Biers of the Nobles Extinguished', '3', 'The Biers of the Nobles are a sign of the unbreakable will of the defenders.  Extinguish them!', '98692', null, null, null, null, null, '8765', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1960', '477', 'Stage III', '2', 'Yrilec the Proud', '1', 'The leader of this force Yrilec the Proud, is all that stands between you and victory. Destroy him and see the spirit of Eataine crushed!', '99659', null, null, null, null, null, '8766', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1961', '478', 'Stage I', '2', 'Woodsong Defenders', '175', 'The Woodsong family estate is well secured. The defenses must be breached before the prize will show herself.', '1050', null, null, null, null, null, '8748', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1962', '478', 'Stage II', '2', 'Woodsong Wardens', '3', 'Aendriel Woodsong, the Woodsong Lark, will no doubt catch a fine price if ransomed back to her family. Defeat her wardens and bring the High Elf Princess to her knees.', '44573', null, null, null, null, null, '8749', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1963', '478', 'Stage II', '0', 'Capture Aendriel Woodsong', '1', 'Aendriel Woodsong, the Woodsong Lark, will no doubt catch a fine price if ransomed back to her family. Defeat her wardens and bring the High Elf Princess to her knees.', '0', null, null, null, null, null, '8749', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1964', '478', 'Stage III', '2', 'Erilyan Woodsong', '1', 'Both gold and glory can be claimed for House Uthorin! Defeat Erilyan Woodsong, Aendriel Woodsong, and Riseneth Thrindel, then claim the Shining Hills for Lord Uthorin!', '46238', null, null, null, null, null, '8750', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1965', '478', 'Stage III', '2', 'Aendriel Woodsong', '1', 'Both gold and glory can be claimed for House Uthorin! Defeat Erilyan Woodsong, Aendriel Woodsong, and Riseneth Thrindel, then claim the Shining Hills for Lord Uthorin!', '40070', null, null, null, null, null, '8750', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1966', '478', 'Stage III', '2', 'Riseneth Thrindel', '1', 'Both gold and glory can be claimed for House Uthorin! Defeat Erilyan Woodsong, Aendriel Woodsong, and Riseneth Thrindel, then claim the Shining Hills for Lord Uthorin!', '46239', null, null, null, null, null, '8750', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1967', '479', 'Stage I', '3', 'Objectives Claimed', '5', 'Ever potent with the Winds of Magic, the High Elves mount a devastating defense. Claim the battlefield locations to drive them back.', '100194', null, null, null, null, null, '8752', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1968', '479', 'Stage II', '2', 'Eversight Windbows Slain', '4', 'The deadly Windbows rain magical arrows down on the newly-taken Dark Elf positions. Slay them before the positions are overrun.', '7093', null, null, null, null, null, '8753', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1969', '479', 'Stage II', '2', 'Banners Lost', '5', 'The deadly Windbows rain magical arrows down on the newly-taken Dark Elf positions. Slay them before the positions are overrun.', '6681', null, null, null, null, null, '8753', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1970', '479', 'Stage III', '2', 'Slay Faliarin Eversight', '1', 'Faliarin Eversight guides the power of the Phoenix Eye against the Dark Elf invaders. Slay him and claim the power of the Phoenix Eye!', '44565', null, null, null, null, null, '8754', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1971', '480', 'Stage I', '2', 'Senthoi Defenders', '50', 'The High Elves belive their warcamp to be impenetrable. Clear the lowest terrace of defenders and defeat their reinforcement patrols to force the defenders to fall back.', '11072', '11059', '11065', null, null, null, '8744', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1972', '480', 'Stage II', '3', 'Second Terrace Conquered', '1', 'The High Elves hide behind arcane fire. Speak with the Siegeblade Lieutenants to divert the attention of the defenders to our weakest troops. Capture the banner at the heart of the middle terrace to force the defenders to fall back.', '0', null, null, null, null, null, '8745', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1973', '480', 'Stage III', '2', 'Hothenir Dawnedge', '1', 'Hothenir Dawnedge stands atop the honored circle of the Senthoi pool and will only allow one challenger to face him at a time. Destroy him, and the warcamp\'s resistance will fail.', '44569', null, null, null, null, null, '8746', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1974', '480', 'Stage III', '2', 'Champion Trueblade', '8', 'Hothenir Dawnedge stands atop the honored circle of the Senthoi pool and will only allow one challenger to face him at a time. Destroy him, and the warcamp\'s resistance will fail.', '42391', null, null, null, null, null, '8746', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1975', '481', 'Stage I', '2', 'Kill Feral Ravagers', '125', 'The Dark Elves that have corrupted the ritual are but mere shadows of their former selves, twisted and bent to the will of Ghur. Slay the Feral Ravagers and put an end to their madness.', '41117', null, null, null, null, null, '9496', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1976', '481', 'Stage II', '3', 'Destroy the Corrupted Stones of the Beasts', '5', 'Before their descent into madness, the Dark Elves corrupted the ancient Stones of the Beasts. These stones must be destroyed for there to be balance in the ritual once more.', '99616', null, null, null, null, null, '9497', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1977', '481', 'Stage III', '2', 'Kill Ilgurik the Nightmare', '1', 'In his attempt to control the Ritual of Beasts, Ilgurik the Nightmare has been corrupted beyond redemption. Slay Ilgurik and end the corruption that taints the Ritual of Ghur.', '1000899', null, null, null, null, null, '9498', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1978', '482', 'Stage I', '2', 'Kill Deathclaw Dark Elves', '125', 'The sacred ground of Tor Sethai has been befouled by the Dark Elves. Slay them and break into the city of Princes.', '40347', '40378', '40382', '40357', null, null, '9548', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1979', '482', 'Stage II', '2', 'Rituals Stopped', '3', 'The spirits of the ancient Dragon Princes that inhabit Tor Sethai are being corrupted by the dark rituals. Slay the Hags to end the spirits\' torment.', '1000343', null, null, null, null, null, '9549', '240', '1', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1980', '482', 'Stage III', '2', 'Kill Makal D\'rkhen', '1', 'The Sorcerers are the key to Rakarth\'s power, and to his hold over the descendants of Tor Sethai. Slay the Sorcerers before Rakarth gains control of the descendants and commands them to do his bidding.', '1000346', null, null, null, null, null, '9550', '240', '1', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1981', '482', 'Stage III', '2', 'Kill Vaarghith Sordhan', '1', 'The Sorcerers are the key to Rakarth\'s power, and to his hold over the descendants of Tor Sethai. Slay the Sorcerers before Rakarth gains control of the descendants and commands them to do his bidding.', '1000348', null, null, null, null, null, '9550', '240', '1', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1982', '482', 'Stage III', '2', 'Kill Illtraneth', '1', 'The Sorcerers are the key to Rakarth\'s power, and to his hold over the descendants of Tor Sethai. Slay the Sorcerers before Rakarth gains control of the descendants and commands them to do his bidding.', '1000347', null, null, null, null, null, '9550', '240', '1', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1983', '482', 'Stage IV', '2', 'Tarkhan Blackblade Slain', '1', 'Tarkhan Blackblade, the deadly assassin, stalks the streets of Tor Sethai. Slay him and end his deadly reign.', '1000349', null, null, null, null, null, '9551', '0', '1', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1984', '482', 'Stage V', '2', 'Slay Beastmaster Rakarth', '1', 'Beastmaster Rakarth is the master of all the Beastmasters in Naggaroth. His command of creatures is unrivaled in the known world. Slay him and end his tyranny.', '1000351', null, null, null, null, null, '9985', '0', '1', '1428', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1985', '483', 'Stage I', '2', 'Wrathwind Forces', '30', 'The Dark Elves have corrupted the ancient ways, turning the Feast of Purity into an abomination of blood! Slay them before they can complete their rite!', '40061', null, null, null, null, null, '9552', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1986', '483', 'Stage II', '3', 'Rescue Halathan Mournvale', '1', 'Aendriel rushes to save her betrothed! Protect the Woodsong Princess and free Halathan Mournvale from the clutches of the Wrathwind Souldrinker!', '98656', null, null, null, null, null, '9553', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1987', '483', 'Stage II', '2', 'Aendriel Dead', '1', 'Aendriel rushes to save her betrothed! Protect the Woodsong Princess and free Halathan Mournvale from the clutches of the Wrathwind Souldrinker!', '40054', null, null, null, null, null, '9553', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1988', '483', 'Stage III', '2', 'Cindiriel Rimesong', '1', 'Aendriel\'s blood has closed the circle and completed the ancient rite. Cindiriel Rimesong must be defeated before she is able to use the power against the Shining Guard army!', '1002004', null, null, null, null, null, '9554', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1989', '483', 'Stage III', '2', 'Fellwind Souldrinker', '2', 'Aendriel\'s blood has closed the circle and completed the ancient rite. Cindiriel Rimesong must be defeated before she is able to use the power against the Shining Guard army!', '1002005', null, null, null, null, null, '9554', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('1990', '484', 'Stage I', '2', 'Forward Camp reclaimed', '1', 'Recapture the small High Elf forward camp. Use the Drakekin Captains and their troops wisely to weather the Uthorin counterattacks.', '0', null, null, null, null, null, '9556', '0', '0', '0', '1', '1');
