INSERT INTO `pquest_objectives` VALUES ('1997', '484', 'Stage III', '2', 'Wrathblood Hydra', '1', 'Use the bolt thrower emplacements and sacred sites of the High Elves to help destroy the massive Hydra before the Uthorin forces can regroup. Do not let the Uthorin forces destroy the High Elf camp.', '1002002', null, null, null, null, null, '9558', '0', '0', '0', '1', '1');
