INSERT INTO `pquest_objectives` VALUES ('2006', '485', 'Stage III', '2', 'Celestial Corrupters', '4', 'The corrupted form of Dragomas has descended upon the mortal world, and the only hope of freeing him is to slay those that have summoned him. The deaths of the Celestial Apprentices will draw the attention of the Celestial Corrupters away from their rituals, making them vulnerable!', '1000904', null, null, null, null, null, '9494', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2007', '485', 'Stage III', '2', 'Free Dragomas\' Celestial Form ', '1', 'The corrupted form of Dragomas has descended upon the mortal world, and the only hope of freeing him is to slay those that have summoned him. The deaths of the Celestial Apprentices will draw the attention of the Celestial Corrupters away from their rituals, making them vulnerable!', '1000905', null, null, null, null, null, '9494', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2008', '486', 'Stage I', '2', 'Kill Corrupted Lifebranches', '30', 'The Dark Elves have sought to corrupt that which creates life. The Lifebranches are tainted by the twisted hearts of your dark kin. Slay them and put an end to this charade.', '15614', null, null, null, null, null, '9484', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2009', '486', 'Stage II', '2', 'Jade Archmage slain', '4', 'Defend the Jade Archmages as they purge the tainted spirit from the Corrupted Tree!', '15590', null, null, null, null, null, '9485', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2010', '486', 'Stage III', '2', 'Kill The Lifeless', '1', 'The Lifeless stalks the Isle of the Dead, holding the power of Ghyran within his grasp. Slay the creature and set free the power of the Wind of Life.', '1000898', null, null, null, null, null, '9486', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2011', '487', 'Stage I', '2', 'Destroy the Tormented Spirits', '125', 'The winds of Shyish blow strong, but carry with them a taint of corruption.', '5982', null, null, null, null, null, '9488', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2012', '487', 'Stage II', '2', 'Destroy Tormentor', '4', 'The Tormentors hold sway over those souls lost long ago during the Sundering. Destroy them and put the souls to rest.', '1002037', null, null, null, null, null, '9489', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2013', '487', 'Stage III', '2', 'Banish The Soul Harvester', '1', 'The Harvester of Souls stalks the lands of Ulthuan. His mere touch can strip the soul from a body and send it adrift on the Sea of Souls to fall prey to the Great Devourer. Banish this beast and reclaim the Ritual of Shyish.', '1002038', null, null, null, null, null, '9490', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2014', '488', 'Stage I', '2', 'Orbs of Hysh Destroyed', '12', 'The Orbs of Hysh must be destroyed if the Ritual of Light is to be corrupted.  Destroy them.', '5974', null, null, null, null, null, '8704', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2015', '488', 'Stage II', '2', 'Thornwood Sorceresses Slain', '6', 'The Thornwood Sorceresses begin their own dark ritual to siphon the power of Hysh. Protect them and ensure the ritual goes as planned.', '40922', null, null, null, null, null, '8705', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2016', '488', 'Stage III', '2', 'Kill Lightmaster Uliennys', '1', 'Using all his knowledge of Hysh to fend off the Dark Elves, the Lightmaster launches his attack. Slay the Lightmaster, and ensure the Sorceresses are protected.', '43912', null, null, null, null, null, '8706', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2017', '489', 'Stage I', '2', 'Kill Aqshy Drakes', '50', 'The Aqshy Drakes have the power to burn flesh from bone. Slay them to gain access to the Braziers of Eternity.', '5990', null, null, null, null, null, '8708', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2018', '489', 'Stage I', '2', 'Flamebearer High Elves', '50', 'The Aqshy Drakes have the power to burn flesh from bone. Slay them to gain access to the Braziers of Eternity.', '5961', null, null, null, null, null, '8708', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2019', '489', 'Stage I', '2', 'Aqshy Sprites', '20', 'The Aqshy Drakes have the power to burn flesh from bone. Slay them to gain access to the Braziers of Eternity.', '1985', null, null, null, null, null, '8708', '0', '0', '0', '1', '1');
