INSERT INTO `pquest_objectives` VALUES ('2021', '489', 'Stage III', '2', 'Kill Cildaeron the Flamelord', '1', 'Cildaeron the Flamelord still holds sway over the ritual. Destroy him and your success will be complete.', '43890', null, null, null, null, null, '8710', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2022', '490', 'Stage I', '2', 'Destroy Transmuted Spirits', '30', 'The Elves that gave their lives in the ritual to Chamon are now cursed to walk the Isle of the Dead encased in their armor. Slay these abominations and weaken the hold of the High Elves on the yellow wind.', '40130', null, null, null, null, null, '8712', '0', '0', '0', '1', '1');
