INSERT INTO `pquest_objectives` VALUES ('2027', '490', 'Stage III', '2', 'Slay Goldryn the Transmuter', '1', 'Goldryn the Transmuter is a master of Chamon. Slay her and her metallic minions, lest your own armor be your doom.', '40129', null, null, null, null, null, '8714', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2028', '491', 'Stage I', '2', 'Destroy the Shadows', '125', 'The very shadows attack from unseen depths. Attack them and drive them off.', '40746', null, null, null, null, null, '8716', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2029', '491', 'Stage II', '3', 'Light the Black Fire Torches', '12', 'The Black Fire Torches are all that can keep the shrouded mists at bay. Light the torches and prepare for whatever abominations emerge.', '99806', null, null, null, null, null, '8717', '0', '0', '0', '1', '1');
