INSERT INTO `pquest_objectives` VALUES ('2159', '550', 'Stage II', '3', 'Hieratic Jars Lost', '10', 'Sah Akhet\'s minions approach to claim the Hieratic Jars! Protect the Temple Reliquary at all costs!', '0', null, null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2160', '550', 'Stage III', '2', 'Sah Akhet Defeated', '1', 'Sah Akhet has come to destroy you! He must be defeated if the Hieratic Jars are to be purified!', '0', null, null, null, null, null, '7970', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2161', '551', 'Stage I', '2', 'Carrion Slain', '30', 'The undead scavengers that flock to this terrible place are thick in the air. If travelers and heroes are to move throughout Zandri safely, these abominations must be destroyed!', '93706', '93563', null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2162', '551', 'Stage II', '3', 'Petrified Eggs Destroyed', '40', 'The nests of the Carrion contain Petrified Eggs, which the undead birds tirelessly defend. Destroy the Eggs in an effort to drive off the Carrion!  You must be close to the Eggs in order to target them!', '98965', null, null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2163', '551', 'Stage III', '2', 'Aped Hek Slain', '1', 'If the lord of the Carrion can be destroyed, then the fate of these vicious scavengers will be sealed!', '2500955', null, null, null, null, null, '7971', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2164', '552', 'Stage I', '2', 'Quarry Workers Destroyed', '30', 'Skeletal Laborers work tirelessly to free ancient bones from the hard-packed soil and rock of the desert. Their work must be disrupted if the Tomb King\'s armies are to be weakened!', '93606', null, null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2165', '552', 'Stage II', '3', 'Scarab Constructs Destroyed', '30', 'The final destruction of the Quarry cannot come to pass so long as the Scarab Constructs run rampant! Destroy them so that the Quarry\'s scaffolds are left vulnerable!\nDisturbing the bone piles activates their magic, forming Scarab Bone Constructs. They must be destroyed  to leave the Quarry\'s scaffolds vulnerable!', '52', null, null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2166', '552', 'Stage III', '2', 'Wer Sebek Destroyed', '1', 'The Bone Giant, called Wer Sebek by the Tomb King, is the Quarry\'s last line of defense! It must be destroyed if the Quarry of Bone is to be taken!', '93561', null, null, null, null, null, '7972', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2167', '553', 'Stage I', '2', 'Skeletons Destroyed', '20', 'The Vulture Lord seeks to deny the invaders the knowledge gathered in his conquests.  Destroy the skeletons and extinguish the bookshelves before he succeeds.', '93583', '93596', null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2168', '553', 'Stage I', '3', 'Bookshelves Extinquished', '10', 'The Vulture Lord seeks to deny the invaders the knowledge gathered in his conquests.  Destroy the skeletons and extinguish the bookshelves before he succeeds.', '100476', null, null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2169', '553', 'Stage II', '3', 'Books and Scrolls Recovered', '6', 'Betrayed by the Vulture Lord, the sentient library turns to the invaders to replenish its stores of knowledge.  Enter the portals to reach distant lands.  Recover the book or scroll found there.  A portal must be defended after someone passes through it.  If it\'s not, then anyone who has traveled through it will be pulled back to the library.', '98977', null, null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2170', '553', 'Stage III', '2', 'Summoned Enemies Killed', '6', 'The Vulture Lord\'s Curator sabotages your efforts with an incantation.  The recovered books and scrolls now act as mediums, drawning beasts from the lands of their origin.  Defeat the enemies to secure the library.', '93592', null, null, null, null, null, '7976', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2171', '554', 'Stage I', '2', 'Pit Dermestids Destroyed', '30', 'Scarab Constructs, guardians of the Pit, have risen in defense of their master. Release them from their imprisonment with fire and cold steel!', '98820', null, null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2172', '554', 'Stage II', '3', 'Bone Piles Scattered', '10', 'The piles of bones strewn throughout the Pit of Kem Senef must be scattered if the Pit Dermestids are to be stopped! Destroy the Bone Piles at once! The Curse of the Outcast can be removed by using any one of the ritual Tears within the Pit!', '52', null, null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2173', '554', 'Stage III', '2', 'Kem Senef the Traitor Defeated', '1', 'Kem Senef the Traitor has risen! His eternal torment has cost him what little humanity he once possessed! Destroy Kem Senef, and grant him the release that he has long desired to have! Beware of his Curse!  ', '1910001', null, null, null, null, null, '7975', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2174', '555', 'Stage I', '2', 'Scarabs Destroyed', '30', 'The Sarcophagi within the Tombs of the Bitter Wind must be sealed, lest the Tomb King\'s minions rise and serve to bolster his armies! Wash your hands in the Penitent\'s Fount at each tomb entrance to gain the Shield of the Penitent which will protect you from the Bitter Wind\'s Curse! Then seal the Sarcophagus within each tomb while you lay the defending Coleopters to their final rest!', '93587', '93591', null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2175', '555', 'Stage I', '3', 'Seal Sarcophagi', '8', 'The Sarcophagi within the Tombs of the Bitter Wind must be sealed, lest the Tomb King\'s minions rise and serve to bolster his armies! Wash your hands in the Penitent\'s Fount at each tomb entrance to gain the Shield of the Penitent which will protect you from the Bitter Wind\'s Curse! Then seal the Sarcophagus within each tomb while you lay the defending Coleopters to their final rest!', '98967', null, null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2176', '555', 'Stage II', '2', 'Bitter Wind Invokers Defeated', '4', 'The Bitter Wind Attendants have been summoned by the Invokers to break the seals on the Sarcophagi! The Attendants must be destroyed if you are to prevent the Sarcophagi within the Tombs of the Bitter Wind from being unsealed! If any of the Sarcophagi are unsealed, you must seal them once again!', '2500957', null, null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2177', '555', 'Stage II', '3', 'Sarcophagi Kept Sealed', '8', 'The Bitter Wind Attendants have been summoned by the Invokers to break the seals on the Sarcophagi! The Attendants must be destroyed if you are to prevent the Sarcophagi within the Tombs of the Bitter Wind from being unsealed! If any of the Sarcophagi are unsealed, you must seal them once again!', '98967', null, null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2178', '555', 'Stage III', '2', 'Hamdi Nuru Defeated', '1', 'Destroy the powerful Liche Priest, Hamadi Nuru, before he can take control of the Tombs of the Bitter Wind!', '2500956', null, null, null, null, null, '7974', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2179', '556', 'Stage I', '3', 'Hieratic Jars Gathered', '10', 'Gather the Hieratic Jars and bring them to the Temple Reliquary to deny Kae Seki control of his Skeletal Serpents. Look for the Hieratic Jars on the outskirts of the temple area.', '98962', null, null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2180', '556', 'Stage II', '3', 'Hieratic Jars Lost', '10', 'Kae Seki \'s minions approach to claim the Hieratic Jars! Protect the Temple Reliquary at all costs!', '0', null, null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2181', '556', 'Stage III', '2', 'Kae Seki Defeated', '1', 'Kae Seki has come to destroy you! He must be defeated if the Sedjhet Icons are to be purified!', '93695', null, null, null, null, null, '7960', '0', '0', '1113', '30', '18');
INSERT INTO `pquest_objectives` VALUES ('2182', '557', 'Stage I', '2', 'Carrion Slain', '30', 'The undead scavengers that flock to this terrible place are thick in the air. If travelers and heroes are to move throughout Zandri safely, these abominations must be destroyed!', '93706', '93563', null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2183', '557', 'Stage II', '3', 'Petrified Eggs Destroyed', '40', 'The nests of the Carrion contain Petrified Eggs, which the undead birds tirelessly defend. Destroy the Eggs in an effort to drive off the Carrion!  You must be close to the Eggs in order to target them!', '98965', null, null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2184', '557', 'Stage III', '2', 'Kheiret Slain', '1', 'If the lord of the Carrion can be destroyed, then the fate of these vicious scavengers will be sealed!', '93699', null, null, null, null, null, '7961', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2185', '558', 'Stage I', '2', 'Doomed Skeletons Destroyed', '30', 'The Obelisk of Judgment once condemned the guilty to an eternity of service to the Tomb King of Zandri. Now, these risen rejects return to slaughter the living in the Tomb King\'s name! Defeat them!', '93698', null, null, null, null, null, '0', '0', '0', '1193', '40', '1000');
INSERT INTO `pquest_objectives` VALUES ('2186', '558', 'Stage II', '2', 'Condemned Skeletons Destroyed', '50', 'Condemned Skeletons, who were once cast out and executed by the Obelisk, return to sow the seeds of death amongst the living! They must be destroyed!', '93700', null, null, null, null, null, '0', '0', '0', '1194', '40', '14');
INSERT INTO `pquest_objectives` VALUES ('2187', '558', 'Stage III', '3', 'Obelisk of Judgement Destroyed', '1', 'The Obelisk is laid bare! Destroy it before the undead it summons can claim your life!', '98972', null, null, null, null, null, '7962', '0', '0', '1190', '30', '18');
INSERT INTO `pquest_objectives` VALUES ('2188', '559', 'Stage I', '2', 'Skeletal Asps Destroyed', '30', 'Destroy the Skeletal Asps that infest the Pit of Asaph in order to quell its defenses!', '93721', '93627', null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2189', '559', 'Stage II', '2', 'Qu\'aph\'s Servants', '15', 'To destroy the Spawn of Asaph, you must first defeat the Qu\'aph\'s Servants that defend them!', '93714', null, null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2190', '559', 'Stage II', '2', 'Spawn of Asaph Destroyed', '3', 'To destroy the Spawn of Asaph, you must first defeat the Qu\'aph\'s Servants that defend them!', '93716', null, null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2191', '559', 'Stage III', '2', 'Ibehme the Fury of Asaph Destroyed', '1', 'Ibehme the Fury of Asaph has been roused! Destroy it before it can bolster the army of the Vulture Lord!', '93719', null, null, null, null, null, '7965', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2192', '560', 'Stage I', '2', 'Hall Defenders Destroyed', '30', 'The Hall of the Heavens must be cleared of its defenses if it is to be used in the casting of auguries. Seek out the defenders and shatter their remains!', '93720', null, null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2193', '560', 'Stage II', '2', 'Celestial Images Destroyed', '20', 'The celestial Images are the last line of defense between your allies and the Hall\'s Avatar! Destroy them!', '93717', null, null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2194', '560', 'Stage III', '2', 'Celestial Avatar Destroyed', '1', 'The Celestial Avatar must be destroyed! If it is not, the Hall of the Heavens will remain under the Tomb King\'s control!', '94045', null, null, null, null, null, '7966', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2195', '561', 'Stage I', '2', 'Scarabs Destroyed', '30', 'The Sarcophagi within the Forbidden Vaults must be sealed, lest the Tomb King\'s minions rise and serve to bolster his armies! Wash your hands in the Penitent\'s Fount at each tomb entrance to gain the Shield of the Penitent which will protect you from the Forbidden Vault\'s Curse! Then seal the Sarcophagus within each tomb while you lay the defending Dorrs to their final rest!', '93637', '93626', null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2196', '561', 'Stage I', '3', 'Seal Sarcophagi', '8', 'The Sarcophagi within the Forbidden Vaults must be sealed, lest the Tomb King\'s minions rise and serve to bolster his armies! Wash your hands in the Penitent\'s Fount at each tomb entrance to gain the Shield of the Penitent which will protect you from the Forbidden Vault\'s Curse! Then seal the Sarcophagus within each tomb while you lay the defending Dorrs to their final rest!', '98967', null, null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2197', '561', 'Stage II', '2', 'Forbidden Invokers Defeated', '4', 'The Forbidden Attendants have been summoned by the Invokers to break the seals on the Sarcophagi! These Attendants must be destroyed if you are to prevent the Sarcophagi within the Forbidden Vaults from being unsealed! If any of the Sarcophagi are unsealed, you must seal them once again!', '93718', null, null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2198', '561', 'Stage II', '3', 'Sarcophagi Kept Sealed', '8', 'The Forbidden Attendants have been summoned by the Invokers to break the seals on the Sarcophagi! These Attendants must be destroyed if you are to prevent the Sarcophagi within the Forbidden Vaults from being unsealed! If any of the Sarcophagi are unsealed, you must seal them once again!', '98967', null, null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2199', '561', 'Stage III', '2', 'Kill Bahiti Net', '1', 'Destroy the powerful Tomb Priestess, Bahiti Net, before she can take control of the Forbidden Vaults!', '93635', null, null, null, null, null, '7964', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2200', '562', 'Stage I', '2', 'Quayside Skeletons Destroyed', '30', 'See to it that the Tomb King\'s minions are cast from the Quay of Seftu!', '99398', '99399', null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2201', '562', 'Stage II', '1', 'Siege Lost', '4', 'The Tomb King has sent reinforcements to take back the docks! Use the Siege Weapons to drive them back, and maintain control of the Quay of Seftu!', '0', null, null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2202', '562', 'Stage III', '2', 'Gahije the Invincible Killed', '1', 'Gahije the Invincible has risen to repel the invaders from the tactically important Quay.  Turn the Nehekharan\'s foul weapons against him!', '0', null, null, null, null, null, '7967', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2203', '563', 'Stage I', '3', 'Architects Found', '8', 'The Pyramid Architects, buried millennia ago so that their secrets would remain safe, can aid you in entering the Pyramid. Use the \'Dig\' ability (on your Temporary Abilities Bar) to find, free, and learn from them!', '0', null, null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2204', '563', 'Stage II', '1', 'Combination Completed', '8', 'Find the Glyphs upon the ground that match those revealed on either side of the Pyramid\'s door. Stand upon the indicated Glyphs that are on the Temple floor to match the door\'s combination!', '0', null, null, null, null, null, '0', '0', '0', '0', '1', '1');
