INSERT INTO `pquest_objectives` VALUES ('2517', '827', 'Stage 1', '0', 'Airship Parts', '30', 'The Lucky Lady is in sore need of repair.  Retrieve the scattered Airship Parts without delay!  ', '0', null, null, null, null, null, '9565', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2518', '827', 'Stage 2', '0', 'Fuel Pumped', '60', 'All that now stands between the Lucky Lady and a successful launch is an empty fuel tank.  Use the fuel pumps to fill the airship\'s fuel tank before the engineers start up the engine!  ', '0', null, null, null, null, null, '9566', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2519', '827', 'Stage 3', '0', 'Airship Damage', '40', 'Wyverns are attacking the Lucky Lady! Use the siege cannons to shoot them down before they claw it to pieces! But beware Gashtail the Gargantuan--the most powerful of the Barbtail Wyverns!  ', '0', null, null, null, null, null, '0', '0', '0', '0', '1', '1');
INSERT INTO `pquest_objectives` VALUES ('2520', '828', 'A Giant Problem', '0', 'Fizzy Grog Drunk', '10', 'Ugrix has broken free!  Ply the Giant with Fizzy Grog before he can damage da Big Floata  ', '0', null, null, null, null, null, '9563', '0', '0', '0', '1', '1');
