INSERT INTO `pquest_objectives` VALUES ('2522', '828', 'Stage 3', '0', 'Inflated Squigs Herded', '35', 'All that now stands between da Big Floata and a successful launch is gravity.  Pour some Fizzy Grog and use it a few times to inflate the squigs.  The Grog is unstable and they may explode!  Herd the survivors into the war balloon so that the airship can take off!  ', '0', null, null, null, null, null, '9561', '0', '0', '0', '1', '1');
