INSERT INTO `pquest_objectives` VALUES ('25588', '841', 'Daemon Moon Rising', '2', 'Destruction Cradles Delivered', '5', 'The energy of the Daemon Cradles may be turned against the forces of Destruction, but five must be set upon the enemy\'s Nest for that to happen. Aid your realm in harnessing the Cradle, but be wary of those who would see you fail. Toss the relic to an ally if the situation becomes dire - and if the enemy gets an upper hand, work toward destroying their relics.', '0', null, null, null, null, null, '0', '0', '0', '0', '1', '1');
